(332, 'Festival', 'Junior', 'Panjabi', 'Term 1', NULL, 'Flag of India', '1.INDIAN FLAG T1  PANJ CULTURE.pdf', 'hwUploads/1.INDIAN FLAG T1  PANJ CULTURE.pdf', 'Colours of the FLAG - known as - 3 colours TIRANGA\r\n1.WHAT ARE THE COLOURS  ?\r\n2. WHAT DO YOU THINK THEY REPRESENT ?\r\nâ€¢	SAFFRON/NARANGI â€“ a symbol of courage and sacrifice\r\nâ€¢	WHITE â€“ symbol of honesty, peace and purity\r\nâ€¢	GREEN â€“ symbol of growth,fertility, agriculture of land \r\n3.WHAT DOES THE WHEEL REPRESENT ?\r\nThe WHEEL (Ashok chakara)- Wheel of Law has 24 spokes representing 24 hours of the day. \r\nThis means India is hardworking and always in motion, like a spinning wheel\r\n4. WHO DESIGNED THE FLAG OF INDIA ?\r\nAND WHEN ?\r\nPINGALI VENKAYYA IN 1916 THE TRI COLOUR\r\nCHAKRA WAS ADOPTED IN 1931 by CONGRESS COMITTEE \r\n\r\n3 colours Colours of the FLAG - known as - 3 colours TIRANGA\r\n1.WHAT ARE THE COLOURS IN GUJARATI ?\r\n2. WHAT DO YOU THINK THEY REPRESENT ?\r\nâ€¢	SAFFRON/NARANGI â€“ a symbol of courage and sacrifice\r\nâ€¢	WHITE â€“ symbol of honesty, peace and purity\r\nâ€¢	GREEN â€“ symbol of growth,fertility, agriculture of land \r\n3.WHAT DOES THE WHEEL REPRESENT ?\r\nThe WHEEL (Ashok chakara)- Wheel of Law has 24 spokes representing 24 hours of the day. \r\nThis means India is hardworking and always in motion, like a spinning wheel\r\n4. WHO DESIGNED THE FLAG OF INDIA ?\r\nAND WHEN ?\r\nPINGALI VENKAYYA IN 1916 THE TRI COLOUR\r\nCHAKRA WAS ADOPTED IN 1931 by CONGRESS COMITTEE \r\n\r\n\r\n\r\n', '11/15/2022', '2022-11-15 16:47:40'),
