(957, 'Festival', 'PrePrep', 'Panjabi', 'Term 1', NULL, 'LOHRI', '3.LOHRI T1 PANJ CULTURE.pdf', 'hwUploads/3.LOHRI T1 PANJ CULTURE.pdf1668617207', 'â€¢	A Punjabi festival celebrated on January 13th each year.\r\nâ€¢	 Lohri is celebrated to mark the end of peak winter.\r\nâ€¢	WHAT IS ITâ€™S SIGNIFICANCE?\r\nâ€¢	The traditional time to harvest sugarcane crops is January, therefore, Lohri is seen by some to be a HARVEST FESTIVAL. \r\n\r\nâ€¢	And thus, Punjabi farmers see the day after Lohri (Maghi) as the financial New Year.\r\n\r\nâ€¢	Traditionally to mark the arrival of a new baby boy but times have changed \r\n\r\nâ€¢	Punjabi families have started celebrating Lohri, for any new baby born into the family\r\nâ€¢	WHAT HAPPENS?\r\nâ€¢	Families DANCE around the bonfire and eat GUR,REWRI, PEANUTS AND POPCORN. \r\n\r\n\r\n', '11/16/2022', '2022-11-16 16:46:47'),
(958, 'Festival', 'Junior', 'Panjabi', 'Term 1', NULL, 'LOHRI', '3.LOHRI T1 PANJ CULTURE.pdf', 'hwUploads/3.LOHRI T1 PANJ CULTURE.pdf1668617263', 'â€¢	A Punjabi festival celebrated on January 13th each year.\r\nâ€¢	 Lohri is celebrated to mark the end of peak winter.\r\nâ€¢	WHAT IS ITâ€™S SIGNIFICANCE?\r\nâ€¢	The traditional time to harvest sugarcane crops is January, therefore, Lohri is seen by some to be a HARVEST FESTIVAL. \r\n\r\nâ€¢	And thus, Punjabi farmers see the day after Lohri (Maghi) as the financial New Year.\r\n\r\nâ€¢	Traditionally to mark the arrival of a new baby boy but times have changed \r\n\r\nâ€¢	Punjabi families have started celebrating Lohri, for any new baby born into the family\r\nâ€¢	WHAT HAPPENS?\r\nâ€¢	Families DANCE around the bonfire and eat GUR,REWRI, PEANUTS AND POPCORN. \r\n\r\n', '11/16/2022', '2022-11-16 16:47:43'),
(959, 'Festival', 'Teen', 'Panjabi', 'Term 1', NULL, 'LOHRI', '3.LOHRI T1 PANJ CULTURE.pdf', 'hwUploads/3.LOHRI T1 PANJ CULTURE.pdf1668617293', 'â€¢	A Punjabi festival celebrated on January 13th each year.\r\nâ€¢	 Lohri is celebrated to mark the end of peak winter.\r\nâ€¢	WHAT IS ITâ€™S SIGNIFICANCE?\r\nâ€¢	The traditional time to harvest sugarcane crops is January, therefore, Lohri is seen by some to be a HARVEST FESTIVAL. \r\n\r\nâ€¢	And thus, Punjabi farmers see the day after Lohri (Maghi) as the financial New Year.\r\n\r\nâ€¢	Traditionally to mark the arrival of a new baby boy but times have changed \r\n\r\nâ€¢	Punjabi families have started celebrating Lohri, for any new baby born into the family\r\nâ€¢	WHAT HAPPENS?\r\nâ€¢	Families DANCE around the bonfire and eat GUR,REWRI, PEANUTS AND POPCORN. \r\n', '11/16/2022', '2022-11-16 16:48:13'),
