(961, 'Festival', 'PrePrep', 'Panjabi', 'Term 1', NULL, 'TAJ MAHAL', '6.TAJ MAHAL T1 PANJ CULTURE.pdf', 'hwUploads/6.TAJ MAHAL T1 PANJ CULTURE.pdf', 'Attracts over million tourists a year!\r\nWHAT DOES IT MEAN ?\r\nIN ARABIC MEANS CROWN OF PALACES)\r\nWHERE IS IT ?\r\nâ€¢	Built in Agra (Uttar Pradesh)in 1632\r\nWHATâ€™S IT MADE OF ?\r\nâ€¢	Ivory/ white marble building\r\nWHY WAS IT BUILT/WHO?\r\nâ€¢	Built by Emperor Shah Jahan in honour of his wife (tomb)\r\nHOW LONG DO YOU THINK IT TO BUILD ?\r\n17 years \r\nFACTS \r\n1.Emperor was going to build another black marble across the river but a war with his sons imterupted this \r\n2.Dome is called ONION DOME \r\n3. Materials used were transported by 1000 elephants !\r\n4. CHANGES COLOURS at different times of day \r\n  Pinkish tone in morning, milky white in evening  and golden at night! to reflect his wifeâ€™s moods !\r\n\r\n', '11/16/2022', '2022-11-16 16:52:38'),
