(965, 'Festival', 'PrePrep', 'Panjabi', 'Term 1', NULL, 'RED FORT', '7.RED FORT T1 PANJ CULTURE.pdf', 'hwUploads/7.RED FORT T1 PANJ CULTURE.pdf', 'WHERE IS IT ?\r\nâ€¢	Old Dehli\r\n        WHATâ€™S IT MADE OF ?\r\nâ€¢	Made of red stone and marble \r\nIt was actually white originally built with sand stones which started chipping off so it was painted red!\r\nWHO WAS IT BUILT BY ?\r\nâ€¢	Built by emperor Shah Jahan in 1638 ( same one as Taj mahal!)\r\n     HOW LONG DID IT TAKE TO BUILD ?\r\n10 years \r\nFACTS \r\nItâ€™s main entrance is called LAHORE GATE it opens towards Lahore \r\nOn independence day, the PM of India hoists the Indian flag from LAHORE GATE \r\nItâ€™s shape is octagonal \r\n    Main residence where emperors lived had lavish parties for 200 years\r\n', '11/16/2022', '2022-11-16 16:59:57'),
