(969, 'Festival', 'Teen', 'Panjabi', 'Term 1', NULL, 'DIWALI/BANDHI CHHOR DIVAS ', '8.DIWALI T1PANJ CULTURE.pdf', 'hwUploads/8.DIWALI T1PANJ CULTURE.pdf', 'â€¢	BIGGEST AND MOST IMPORTANT DAY OF THE YEAR IN NORTH INDIA \r\nâ€¢	1.WHY IS DIWALI CELEBERATED ?\r\nâ€¢	Celebrates new beginnings and the triumph of good over evil and light over darkness. \r\nâ€¢	Diwali is celebrated on NEW MOON DAY, when itâ€™s absolute darkness. \r\nâ€¢	WHAT HAPPENS ?\r\nâ€¢	Houses are lit with candles, colourful lights and firework displays and families share gifts and feast together. \r\nâ€¢	Therefore, people light lamps and candles to get rid of darkness.\r\nâ€¢	CELEBRATE WITH RANGOLIS,DIYAS AND WORSHIP GODDESS LAXSHMI\r\nâ€¢	HOW LONG IS DIWALI \r\nâ€¢	FIVE DAY FESTIVAL OF LIGHTS\r\nâ€¢	WHICH MONTH IS IT CELEBRATED ?\r\nâ€¢	CELEBRATED LATE OCTOBER /NOV  \r\nâ€¢	STORY\r\nâ€¢	Bandi Chhor Divas celebrates a Sikh historic event related to the sixth Guru, Guru Hargobind ji was sent to prison in 1619 as he did not agree with the Mughal Emperor. \r\nâ€¢	On this day, Guru Hargobind was released from prison and wouldnâ€™t leave till he was able to secure the release of 52 kings, imprisoned by Mughal Emperor Jahangir\r\n', '11/16/2022', '2022-11-16 17:06:27'),
