(973, 'Festival', 'PrePrep', 'Panjabi', 'Term 1', NULL, 'VAISAKHI', '9.VAISAKHI T1 PANJ CULTURE.pdf', 'hwUploads/9.VAISAKHI T1 PANJ CULTURE.pdf', 'â€¢	April 13th/14th every year. \r\nâ€¢	One of the most important dates in Sikh calendar.\r\nâ€¢	Marks the beginning of the New Year for Sikhs and is the Spring harvest festival of Punjab \r\nâ€¢	Sikh festival marking the birth of Sikhism in 1699\r\nâ€¢	When the 10th Guru,Guru Gobind Singh ji, formed the Khalsa panth (the community of committed Sikhs). \r\nâ€¢	Itâ€™s not a holiday, but an occasion for celebrating the community  and our shared values \r\n\r\n', '11/16/2022', '2022-11-16 17:11:24'),
