(977, 'Festival', 'PrePrep', 'Panjabi', 'Term 2', NULL, 'SIKH WEDDING ', '1.SIKH -Wedding-T2 PANJ CULTURE.pdf', 'hwUploads/1.SIKH -Wedding-T2 PANJ CULTURE.pdf', '    WHERE IS IT HELD AND HOW LONG DOES IT LAST\r\nâ€¢	Gurdwara, a Sikh place of worship\r\nâ€¢	Lasts less than an hour. \r\nWHAT ARE DIFFERENT CEREMONIES OF SIKH WEDDING \r\nâ€¢	CHUNNI CHADAI: After the engagement, the groomâ€™s mother covers the brideâ€™s head with a CHUNNI and gifts the bride with clothes, jewellery, etc.\r\nWHAT HAPPENS BEFORE THE WEDDING ?\r\nâ€¢	MEHNDI is when the bride gets her hands and feet decorated in beautiful henna/mehndi designs.\r\nâ€¢	CHOODA CEREMONY\r\nâ€¢	 The brideâ€™s maternal uncle puts a set of red and white bangles on the bride \r\nâ€¢	VATNA\r\nâ€¢	A paste of turmeric powder and mustard oil, is applied to the bride and groom before the wedding for a natural glow.\r\nWHAT HAPPENS ON THE DAY OF THE WEDDING ?\r\n    MILNI\r\nâ€¢	Brideâ€™s family welcomes the groom, as he reaches the wedding venue  and they exchange garlands.\r\n     ANAND KARAJ\r\nâ€¢	The MAIN Sikh wedding ceremony. Anand Karaj translates to â€˜blissful unionâ€™.\r\nThe Priest recites ARDHAS (a set of prayers), while the bride and groom are seated in the Gurdwara \r\nLAAVAN PHERAS\r\nâ€¢	Laavan are the four prayers that seal the marriage.\r\nThe Brideâ€™s Pallu and the Groomâ€™s shawl/dupatta are tied together as a symbol of unity. \r\nâ€¢	They then take rounds around their holy book, the Guru Granth Sahib, as the LAAVAN is chanted. \r\n', '11/16/2022', '2022-11-16 17:18:00'),
