(999, 'Festival', 'PrePrep', 'Panjabi', 'Term 2', NULL, 'OUR GURUS', '6.Guru Nanak Dev ji T2 PANJ CULTURE.pdf', 'hwUploads/6.Guru Nanak Dev ji T2 PANJ CULTURE.pdf', '         HOW MANY GURUS ARE THERE ? \r\n10 GURUS \r\nWHEN WAS SIKHISM FOUNDED ? \r\n500 YEARS AGO \r\nâ€¢	GURU NANAK DEV JI is our founder of Sikhism and the first of our 10 Gurus (1469 -1539).\r\nâ€¢	HE TAUGHT THAT THERE IS ONLY ONE GOD AND ALL RELIGIONS FOLLOW THIS GOD IN SOME MANNER \r\nâ€¢	WHEN IS HIS BIRTHDAY AND WHAT IS IT CALLED ?\r\nâ€¢	Guru Nanak jiâ€™s birthday is celebrated in NOV/DEC of each year and is called GURPURAB.\r\nâ€¢	He travelled far and wide, spreading the message of God.\r\nâ€¢	WHAT IS OUR HOLY BOOK CALLED?\r\nâ€¢	Our HOLY BOOK  is called GURU GRANTH SAHIB, where his poems are written and recited in our Gurdwaras around the world.\r\nâ€¢	ITS THE ONLY SCRIPTURE OF ITS KIND WHICH NOT ONLY CONTAINS THE WORKS OF ITS OWN RELIGIOUS FOUNDERS  BUT ALSO WRITINGS OF OTHER FAITHS \r\n\r\nâ€¢	NO SIKH CEREMONY IS CONSIDERED  COMPLETE UNLESS ITS PERFORMED IN THE PRESENCE OG GGS ( BLESSING OF A BABY /DEATH/MARRIAGE )\r\n\r\nâ€¢	WHO IS GURU GOBIND SINGH JI ?\r\nâ€¢	GURU GOBIND Singh Ji is the 10th of our Gurus.HE WAS BORN IN 1666\r\nâ€¢	WHAT DID HE DO ?\r\nâ€¢	CREATED THE KHALSA ( PURE ONES ) AND GAVE THE SIKHS THE NAME SINGH (LION) AND KAUR (PRINCESS) \r\n', '11/16/2022', '2022-11-16 17:45:38'),
