(1026, 'Festival', 'Adults', 'Panjabi', 'Term 3', NULL, 'INDIAN FOOD ', '5.Food & Spices T3 CULTURE.pdf', 'hwUploads/5.Food & Spices T3 CULTURE.pdf1668622515', 'India is a large and very diverse country, with a wide variety of agricultural products, which differ from region to region.\r\nWHAT ARE THE MAIN INDIAN STAPLE FOODS\r\nIndian staple food are rice, lentils, breads( roti/naan) and spices. \r\nMany dishes contain vegetables, such as spinach, peas or mustard greens as well as fruit such as mango, pineapple or bananas.\r\nWHAT ARE THE COMMONLY USED SPICES?\r\nIndian food is generally famous for being spicy.Commonly used spices are chilli and ginger, cardamon, cinnamon, cumin, coriander and cloves.\r\nOTHER FACTS \r\nMany dishes also use yoghurt, cottage cheese or paneer \r\nFish and seafood at the coastal regions \r\n', '11/16/2022', '2022-11-16 18:15:15'),
(1027, 'Festival', 'PrePrep', 'Panjabi', 'Term 3', NULL, 'MUSICAL INSTRUMENTS ', '6.Musical Instruments T3 CULTURE.pdf', 'hwUploads/6.Musical Instruments T3 CULTURE.pdf', 'WHAT ARE THE MAIN MUSICAL INSTRUMENTS IN INDIA ?\r\nSITAR, TABLA, HARMONIUM , BANSURI, DAMRU, DHOL(AK)\r\nSITAR \r\nItâ€™s a stringed instrument with a pear-shaped body with a long, hollow wooden neck and bridge.  It produces a rich sound when the strings are plucked, which resonates due to its design.\r\nTabla\r\nThe tabla consists of two single headed (Daya and Baya)drums that are different from each other in shape and size. \r\nBansuri\r\n \r\nBansuri is a side blown flute and is a single hollow shaft of bamboo consisting of two ends, one closed and another one open. It also consists of six to seven finger holes\r\nDamru\r\nThe damaru is a two headed drum made of wood. The instrument consists of beads and knots in the leather cord which produces sound as it strikes the surfaces\r\n \r\nDhol(ak)\r\nThe Dhol(ak) is a two-headed drum that produces sound when struck by hand and  is mainly used as an Indian Folk Instrument to produce sound during weddings and prayer rituals.\r\n \r\nâ€¢	HARMONIUM \r\nImported from west in late 19th century \r\nMost widely used instruments in India \r\nKeyboard with bellows \r\n', '11/16/2022', '2022-11-16 18:17:45'),
