(1031, 'Festival', 'PrePrep', 'Panjabi', 'Term 3', NULL, 'INDIAN GAMES ', '7.INDIAN GAMES  T3 CULTURE.pdf', 'hwUploads/7.INDIAN GAMES  T3 CULTURE.pdf', 'WHAT ARE THE MAIN GAMES PLAYED IN INDIA ?\r\nKHO KHO, KABBADI,KITH KITH,CARROM \r\n KHO KHO\r\nThe game requires a very small piece of evenly surfaced ground, rectangular in shape, and 2 two poles. \r\nThe game lasts no more than 37 minutes. which in its simplest form involves chasing and touching a person.\r\nKABBADI \r\n2 teams of seven players compete with each other for higher scores, by touching or capturing the players of the opponent team. \r\nKITH KITH \r\nCricket played with a stick instead of a bat is exactly the structure of Gilli Danda. \r\nCARROM\r\nCarrom is similar to Pool but instead of pool cues, you use your fingers and a striker. The game can be played by either two people (singles) or four people (doubles)..\r\n', '11/16/2022', '2022-11-16 18:20:31'),
