(1039, 'Festival', 'PrePrep', 'Panjabi', 'Term 3', NULL, 'MOTHER TERESA ', '9.MOTHER TERESA T3 CULTURE.pdf', 'hwUploads/9.MOTHER TERESA T3 CULTURE.pdf', 'WHAT IS SHE FAMOUS FOR ?\r\n\r\nMother Teresa devoted her whole life to serving the poor and needy, mainly in India but also around the world.\r\nWHAT PRIZES DID SHE RECIEVE?\r\nâ€¢	She received many prizes and awards as recognition for her charity institutions and services for humanity.\r\nâ€¢	She was also given much deserved Nobel Peace Prize in 1979.\r\n\r\nWHERE AND WHEN WAS SHE BORN ?\r\n     Born in Albania /1910 -1997\r\nACHEIVEMENTS AND FACTS \r\nâ€¢	She was proclaimed a saint by the Catholic Church in 2016. \r\nâ€¢	In 1948, she started her teaching as a missionary by having on white â€˜sariâ€™ with blue lines on the sides of it.\r\n\r\nâ€¢	In Calcutta in 1952, Mother Teresa built the very first Home for the Dying.\r\n\r\nâ€¢	She built a home for those persons who had a disease called Leprosy. \r\n\r\n\r\nâ€¢	In 1955, she built another school for orphans and children who were lost.\r\n\r\n', '11/16/2022', '2022-11-16 18:28:34'),
