(1071, 'Festival', 'PrePrep', 'Panjabi', 'Term 5', NULL, 'FOOD FACTS', '3.FOOD CULTURE  T5.pdf', 'hwUploads/3.FOOD CULTURE  T5.pdf1668626114', 'WHAT IS THE NATIONAL DRINK OF INDIA ?WATER/TEA OR MILK\r\nTea is the national beverage of India\r\nItâ€™s no secret that Indians love tea!\r\nIndia is the second-largest producer of tea in the world, following closely behind China.\r\nWHAT DOES INDIA PRODUCE THE MOST IN THE WORLD ? SPICES, RICE OR WHEAT ?\r\nAround 70% of the worldâ€™s spices come from India\r\nIndia is by far the largest producer of spices, which are shipped across continents to restaurants and kitchens worldwide.\r\nNAME SOME SPICES !\r\n Some of the best-known spices are turmeric, cumin, saffron, and chili powders.\r\nWHAT DID INDIA PRODUCE FIRST IN THE WORLD ?\r\nSUGAR / SALT OR TURMERIC ?\r\nIndia was the first country to refine and consume sugar\r\nIndia was the first place were sugar was extracted, refined, and used in cooking â€“ although once people got a taste of the delicious stuff, sugar production quickly spread around the world.\r\nThe state of Haryana produces over 60% of the basmati rice in India.\r\nRice is the staple food of India.\r\nDum biryani was originally a money-saving dish engineered by the Nawab of Awadh to feed the poor.\r\nThe worldâ€™s hottest chilli, bhut jolokia, is from India.\r\n', '11/16/2022', '2022-11-16 19:15:14'),
