(1075, 'Festival', 'PrePrep', 'Panjabi', 'Term 5', NULL, 'SPORTING FACTS', '4.SPORT CULTURE T5.pdf', 'hwUploads/4.SPORT CULTURE T5.pdf', 'WHICH SPORT WAS CREATED IN INDIA?\r\nMARTIAL ARTS/FOOTBALL /TENNIS ?\r\nMartial Arts were first created in India, and later spread to Asia by Buddhist missionaries.\r\nYoga has its origins in India and has existed for over 5,000 years.\r\nChess happens to find its roots in India.\r\nHOW MANY MEDALS HAS INDIA WON IN OLYMPICS \r\nIndia has won 26 medals in the Olympic Games.\r\nThe first time India participated in the Olympics was in 1900\r\nWHICH SPORTING ORGANSATION HAS THE MOST MONEY SPENT ON IT ? NBA/FIFA/IPL\r\nSECOND HIGHEST ? IPL/FIFA ?\r\nThe IPL has the second highest amount of money spent on it, after the NBA.\r\nSarfaraz Khan was only ten years old during the first IPL match. Now he is 17.\r\nSachin Tendulkar fielded for Pakistan once â€“ Ahead of a Test series in 1987, India and Pakistan were playing an exhibition match where Imran Khanâ€™s team was short on fielders. It was then that a 13-year-old Sachin was asked to field for Pakistan.\r\nWHICH YEAR DID INDIA WIN ITâ€™S 1ST GOLD MEDAL?\r\n1928/38/48\r\nIndia won its 1st Gold Medal in Olympic in the year 1928 in hockey.\r\n', '11/16/2022', '2022-11-16 19:18:57'),
