(1079, 'Festival', 'PrePrep', 'Panjabi', 'Term 5', NULL, 'LANGAUGE FACTS OF INDIA ', '5.MAP OF INDIA CULTURE  T5.pdf', 'hwUploads/5.MAP OF INDIA CULTURE  T5.pdf1668626616', 'India has the second largest English-speaking population after the United States.\r\n\r\nWith documents dating back as early as 5,500 BCE, Hinduism is considered the oldest religion in the world. \r\n\r\nThere is not a known founder of Hinduism, and no one cares to know who started Hinduism since Hinduism is a way of life.\r\nWHATâ€™S THE OLDEST LANGUAGE IN THE WORLD ? SANSKRIT/HINDI OR ENGLISH ?\r\nSanskrit is considered the oldest language in the world, the â€œmother of all languages.â€\r\n Every Hindu book is written in Sanskrit, and it is said that Sanskrit is the language of the demi-Gods.\r\nAll the European languages were derived from Sanskrit, which happens to be the oldest and richest language, again, from India.\r\n', '11/16/2022', '2022-11-16 19:23:36'),
