(1526, 'Festival', 'PrePrep', 'Panjabi', 'Term 6', NULL, 'BHANGRA ', '1. BHANGRA DANCE CULTURE  T6.pdf', 'hwUploads/1. BHANGRA DANCE CULTURE  T6.pdf', 'BHANGRA is a type of traditional folk dance of the Indian subcontinent, originating in the Sialkot area of Panjab.\r\nIn a typical performance, several dancers execute vigorous kicks, leaps, and bends of the bodyâ€”often with upraised, thrusting arm or shoulder movementsâ€”to the accompaniment of short songs called boliyan and, most significantly, to the beat of a dhol (double-headed drum).\r\n', '11/17/2022', '2022-11-17 13:40:03'),
(1527, 'Festival', 'Junior', 'Panjabi', 'Term 6', NULL, 'BHANGRA ', '1. BHANGRA DANCE CULTURE  T6.pdf', 'hwUploads/1. BHANGRA DANCE CULTURE  T6.pdf1668692450', 'BHANGRA is a type of traditional folk dance of the Indian subcontinent, originating in the Sialkot area of Panjab.\r\nIn a typical performance, several dancers execute vigorous kicks, leaps, and bends of the bodyâ€”often with upraised, thrusting arm or shoulder movementsâ€”to the accompaniment of short songs called boliyan and, most significantly, to the beat of a dhol (double-headed drum).\r\n', '11/17/2022', '2022-11-17 13:40:50'),
(1528, 'Festival', 'Teen', 'Panjabi', 'Term 6', NULL, 'BHANGRA', '1. BHANGRA DANCE CULTURE  T6.pdf', 'hwUploads/1. BHANGRA DANCE CULTURE  T6.pdf1668692498', 'BHANGRA is a type of traditional folk dance of the Indian subcontinent, originating in the Sialkot area of Panjab.\r\nIn a typical performance, several dancers execute vigorous kicks, leaps, and bends of the bodyâ€”often with upraised, thrusting arm or shoulder movementsâ€”to the accompaniment of short songs called boliyan and, most significantly, to the beat of a dhol (double-headed drum).\r\n', '11/17/2022', '2022-11-17 13:41:38'),
(1529, 'Festival', 'PrePrep', 'Panjabi', 'Term 6', NULL, 'BHARATNATYAM ', '2. BHARAT NATYAM DANCE CULTURE T6.pdf', 'hwUploads/2. BHARAT NATYAM DANCE CULTURE T6.pdf', ' Bharatanatyam is the oldest classical dance tradition in India.\r\nBharatanatyam contains different types of banis. Bani, or tradition, is a term used to describe the dance technique and style specific to a guru or school. \r\nThese are named according to the village of the guru (with the exception of some banis). \r\nBharatanatyam style is noted for its fixed upper torso, bent legs and knees flexed (Aramandi) combined with spectacular footwork, and a sophisticated vocabulary of sign language based on gestures of hands, eyes, and face muscles.\r\n', '11/17/2022', '2022-11-17 13:43:16'),
(1530, 'Festival', 'Junior', 'Panjabi', 'Term 6', NULL, 'BHARATNATYAM', '2. BHARAT NATYAM DANCE CULTURE T6.pdf', 'hwUploads/2. BHARAT NATYAM DANCE CULTURE T6.pdf1668692629', ' Bharatanatyam is the oldest classical dance tradition in India.\r\nBharatanatyam contains different types of banis. Bani, or tradition, is a term used to describe the dance technique and style specific to a guru or school. \r\nThese are named according to the village of the guru (with the exception of some banis). \r\nBharatanatyam style is noted for its fixed upper torso, bent legs and knees flexed (Aramandi) combined with spectacular footwork, and a sophisticated vocabulary of sign language based on gestures of hands, eyes, and face muscles.\r\n', '11/17/2022', '2022-11-17 13:43:49'),
(1531, 'Festival', 'Teen', 'Panjabi', 'Term 6', NULL, 'BHARATNATYAM', '2. BHARAT NATYAM DANCE CULTURE T6.pdf', 'hwUploads/2. BHARAT NATYAM DANCE CULTURE T6.pdf1668692692', ' Bharatanatyam is the oldest classical dance tradition in India.\r\nBharatanatyam contains different types of banis. Bani, or tradition, is a term used to describe the dance technique and style specific to a guru or school. \r\nThese are named according to the village of the guru (with the exception of some banis). \r\nBharatanatyam style is noted for its fixed upper torso, bent legs and knees flexed (Aramandi) combined with spectacular footwork, and a sophisticated vocabulary of sign language based on gestures of hands, eyes, and face muscles.\r\n', '11/17/2022', '2022-11-17 13:44:52'),
(1532, 'Festival', 'PrePrep', 'Panjabi', 'Term 6', NULL, 'KATHAKALI', '3. KATHAK KALI DANCE CULTURE T6.pdf', 'hwUploads/3. KATHAK KALI DANCE CULTURE T6.pdf', 'KATHAKALI is a major form of classical Indian dance.It is a \"story play\" , but one distinguished by the elaborately colourful make-up, costumes and face masks that the traditionally male actor-dancers wear.\r\nKathakali is a Hindu performance art in the Malayalam-speaking southwestern region of Kerala\r\n\r\nKathakali is one of the eight classical dances of India\r\n', '11/17/2022', '2022-11-17 13:45:55'),
(1533, 'Festival', 'Junior', 'Panjabi', 'Term 6', NULL, 'KATHAKALI', '3. KATHAK KALI DANCE CULTURE T6.pdf', 'hwUploads/3. KATHAK KALI DANCE CULTURE T6.pdf1668692788', 'KATHAKALI is a major form of classical Indian dance.It is a \"story play\" , but one distinguished by the elaborately colourful make-up, costumes and face masks that the traditionally male actor-dancers wear.\r\nKathakali is a Hindu performance art in the Malayalam-speaking southwestern region of Kerala\r\n\r\nKathakali is one of the eight classical dances of India\r\n', '11/10/2022', '2022-11-17 13:46:28'),
(1534, 'Festival', 'Teen', 'Panjabi', 'Term 6', NULL, 'KATHAKALI', '3. KATHAK KALI DANCE CULTURE T6.pdf', 'hwUploads/3. KATHAK KALI DANCE CULTURE T6.pdf1668692839', 'KATHAKALI is a major form of classical Indian dance.It is a \"story play\" , but one distinguished by the elaborately colourful make-up, costumes and face masks that the traditionally male actor-dancers wear.\r\nKathakali is a Hindu performance art in the Malayalam-speaking southwestern region of Kerala\r\n\r\nKathakali is one of the eight classical dances of India\r\n', '11/10/2022', '2022-11-17 13:47:19'),
(1535, 'Festival', 'PrePrep', 'Panjabi', 'Term 6', NULL, 'RAJASTHANI DANCE ', '5. RAJASTHANI DANCE CULTURE T6.pdf', 'hwUploads/5. RAJASTHANI DANCE CULTURE T6.pdf', 'Ghoomar or Ghumar is a traditional folk dance of Rajasthan.\r\n\r\n It was Bhil tribe who performed it to worship Goddess Sarasvati which was later embraced by other Rajasthani communities. \r\nThe dance is chiefly performed by veiled women who wear flowing dresses called ghaghara. The dance typically involves performers pirouetting while moving in and out of a wide circle. \r\nThe word ghoomna describes the twirling movement of the dancers and is the basis of the word ghoomar. \r\n', '11/10/2022', '2022-11-17 13:50:20'),
(1536, 'Festival', 'Junior', 'Panjabi', 'Term 6', NULL, 'RAJASTHANI DANCE ', '5. RAJASTHANI DANCE CULTURE T6.pdf', 'hwUploads/5. RAJASTHANI DANCE CULTURE T6.pdf1668693059', 'Ghoomar or Ghumar is a traditional folk dance of Rajasthan.\r\n\r\n It was Bhil tribe who performed it to worship Goddess Sarasvati which was later embraced by other Rajasthani communities. \r\nThe dance is chiefly performed by veiled women who wear flowing dresses called ghaghara. The dance typically involves performers pirouetting while moving in and out of a wide circle. \r\nThe word ghoomna describes the twirling movement of the dancers and is the basis of the word ghoomar. \r\n', '11/10/2022', '2022-11-17 13:50:59'),
(1537, 'Festival', 'Teen', 'Panjabi', 'Term 6', NULL, 'RAJASTHANI DANCE ', '5. RAJASTHANI DANCE CULTURE T6.pdf', 'hwUploads/5. RAJASTHANI DANCE CULTURE T6.pdf1668693092', 'Ghoomar or Ghumar is a traditional folk dance of Rajasthan.\r\n\r\n It was Bhil tribe who performed it to worship Goddess Sarasvati which was later embraced by other Rajasthani communities. \r\nThe dance is chiefly performed by veiled women who wear flowing dresses called ghaghara. The dance typically involves performers pirouetting while moving in and out of a wide circle. \r\nThe word ghoomna describes the twirling movement of the dancers and is the basis of the word ghoomar. \r\n', '11/10/2022', '2022-11-17 13:51:32'),
(1538, 'Festival', 'PrePrep', 'Panjabi', 'Term 6', NULL, 'HARAYANA  DANCE ', '7. HARYANA DANCE CULTURE T6.pdf', 'hwUploads/7. HARYANA DANCE CULTURE T6.pdf', 'Loor Dance\r\nGirls perform the Loor dance, during the month of Phalguna, also known as the spring season.\r\nThis Loor dance is named after the girls in the Bangar area of Haryana. \r\nIt is specially performed during the Holi festival. \r\nThis dance marks the arrival of pleasant spring season and with it the sowing of the Rabi crops in the farms. \r\nThe songs are generally in the form of questions and answers format. \r\n', '11/17/2022', '2022-11-17 13:53:19'),
(1539, 'Festival', 'Junior', 'Panjabi', 'Term 6', NULL, 'HARYANA DANCE ', '7. HARYANA DANCE CULTURE T6.pdf', 'hwUploads/7. HARYANA DANCE CULTURE T6.pdf1668693239', 'Loor Dance\r\nGirls perform the Loor dance, during the month of Phalguna, also known as the spring season.\r\nThis Loor dance is named after the girls in the Bangar area of Haryana. \r\nIt is specially performed during the Holi festival. \r\nThis dance marks the arrival of pleasant spring season and with it the sowing of the Rabi crops in the farms. \r\nThe songs are generally in the form of questions and answers format. \r\n', '11/17/2022', '2022-11-17 13:53:59'),
(1540, 'Festival', 'Teen', 'Panjabi', 'Term 6', NULL, 'HARYANA DANCE ', '7. HARYANA DANCE CULTURE T6.pdf', 'hwUploads/7. HARYANA DANCE CULTURE T6.pdf1668693271', 'Loor Dance\r\nGirls perform the Loor dance, during the month of Phalguna, also known as the spring season.\r\nThis Loor dance is named after the girls in the Bangar area of Haryana. \r\nIt is specially performed during the Holi festival. \r\nThis dance marks the arrival of pleasant spring season and with it the sowing of the Rabi crops in the farms. \r\nThe songs are generally in the form of questions and answers format. \r\n', '11/17/2022', '2022-11-17 13:54:31'),
(1541, 'Festival', 'PrePrep', 'Panjabi', 'Term 6', NULL, 'ODISSI DANCE ', '8. ODISSI DANCE CULTURE T6.pdf', 'hwUploads/8. ODISSI DANCE CULTURE T6.pdf', 'ODISSI originated in Orissa, India\r\nOdissi is a major ancient Indian classical dance that originated in the Hindu temples of Odisha â€“ an eastern coastal state of India.\r\nOdissi, in its history, was performed predominantly by women and expressed religious stories and spiritual ideas.\r\n\r\nOdissi performances have also expressed ideas of other traditions such as those related to Hindu gods Shiva and Surya, as well as Hindu goddesses\r\n', '11/17/2022', '2022-11-17 13:55:42'),
(1542, 'Festival', 'Junior', 'Panjabi', 'Term 6', NULL, 'ODISSI DANCE ', '8. ODISSI DANCE CULTURE T6.pdf', 'hwUploads/8. ODISSI DANCE CULTURE T6.pdf1668693381', 'ODISSI originated in Orissa, India\r\nOdissi is a major ancient Indian classical dance that originated in the Hindu temples of Odisha â€“ an eastern coastal state of India.\r\nOdissi, in its history, was performed predominantly by women and expressed religious stories and spiritual ideas.\r\n\r\nOdissi performances have also expressed ideas of other traditions such as those related to Hindu gods Shiva and Surya, as well as Hindu goddesses\r\n', '11/17/2022', '2022-11-17 13:56:21'),
(1543, 'Festival', 'Teen', 'Panjabi', 'Term 6', NULL, 'ODISSI DANCE ', '8. ODISSI DANCE CULTURE T6.pdf', 'hwUploads/8. ODISSI DANCE CULTURE T6.pdf1668693422', 'ODISSI originated in Orissa, India\r\nOdissi is a major ancient Indian classical dance that originated in the Hindu temples of Odisha â€“ an eastern coastal state of India.\r\nOdissi, in its history, was performed predominantly by women and expressed religious stories and spiritual ideas.\r\n\r\nOdissi performances have also expressed ideas of other traditions such as those related to Hindu gods Shiva and Surya, as well as Hindu goddesses\r\n', '11/17/2022', '2022-11-17 13:57:02'),
(1544, 'Festival', 'PrePrep', 'Panjabi', 'Term 6', NULL, 'BIHU DANCE ', '9. BIHU DANCE CULTURE T6.pdf', 'hwUploads/9. BIHU DANCE CULTURE T6.pdf', 'The Bihu dance is an indigenous folk dance from the Indian state of Assam related to the Bihu festival and an important part of Assamese culture. \r\nPerformed in a group, the Bihu dancers are usually young men and women, and the dancing style is characterized by brisk steps, and rapid hand movements.\r\nThe traditional costume of dancers is colorful and centred round the red colour theme, signifying joy and vigour.\r\n \r\nThe earliest depiction of Bihu dance is found in the 9th century \r\n\r\nThe dance begins with the performers, young men and women, slowly walking into the performance space. \r\nThe men then start playing musical instruments, like drums (particularly the double-headed dhol), horn-pipes and flutes, while the women place their hands above their hips with their palms facing outwards, forming an inverted triangular shape.\r\n\r\n\r\nOdissi performances have also expressed ideas of other traditions such as those related to Hindu gods Shiva and Surya, as well as Hindu goddesses\r\n', '11/17/2022', '2022-11-17 13:57:38'),
(1545, 'Festival', 'Junior', 'Panjabi', 'Term 6', NULL, 'BIHU DANCE ', '9. BIHU DANCE CULTURE T6.pdf', 'hwUploads/9. BIHU DANCE CULTURE T6.pdf1668693498', '\r\nThe Bihu dance is an indigenous folk dance from the Indian state of Assam related to the Bihu festival and an important part of Assamese culture. \r\nPerformed in a group, the Bihu dancers are usually young men and women, and the dancing style is characterized by brisk steps, and rapid hand movements.\r\nThe traditional costume of dancers is colorful and centred round the red colour theme, signifying joy and vigour.\r\n \r\nThe earliest depiction of Bihu dance is found in the 9th century \r\n\r\nThe dance begins with the performers, young men and women, slowly walking into the performance space. \r\nThe men then start playing musical instruments, like drums (particularly the double-headed dhol), horn-pipes and flutes, while the women place their hands above their hips with their palms facing outwards, forming an inverted triangular shape.\r\n', '11/17/2022', '2022-11-17 13:58:18'),
(1546, 'Festival', 'Teen', 'Panjabi', 'Term 6', NULL, 'BIHU DANCE ', '9. BIHU DANCE CULTURE T6.pdf', 'hwUploads/9. BIHU DANCE CULTURE T6.pdf1668693542', '\r\nThe Bihu dance is an indigenous folk dance from the Indian state of Assam related to the Bihu festival and an important part of Assamese culture. \r\nPerformed in a group, the Bihu dancers are usually young men and women, and the dancing style is characterized by brisk steps, and rapid hand movements.\r\nThe traditional costume of dancers is colorful and centred round the red colour theme, signifying joy and vigour.\r\n \r\nThe earliest depiction of Bihu dance is found in the 9th century \r\n\r\nThe dance begins with the performers, young men and women, slowly walking into the performance space. \r\nThe men then start playing musical instruments, like drums (particularly the double-headed dhol), horn-pipes and flutes, while the women place their hands above their hips with their palms facing outwards, forming an inverted triangular shape.\r\n', '11/17/2022', '2022-11-17 13:59:02'),
(1547, 'Festival', 'PrePrep', 'Panjabi', 'Term 6', NULL, 'SANTHAL DANCE ', '10. SANTHAL DANCE CULTURE T6.pdf', 'hwUploads/10. SANTHAL DANCE CULTURE T6.pdf', 'The Santhal dance is considered to be one of the best tribal folk dances of India, which offers immense vibrancy and cheerfulness. \r\n\r\nThis dance is supposed to be a replica of the folk dance of Madhya Pradesh. \r\n\r\nSanthal dance is generally performed by both the men and women of the Santhali tribe.\r\n\r\nSanthal is a very popular folk dance of Jharkhand. \r\n\r\nIt is a group dance performed by Santhal tribes of Jharkhand. \r\n\r\nThis dance was performed by the Santhal tribes during all special festivals and occasions. \r\n\r\nThis dance not only reveals the culture or traditions of the local tribes but also showcases the strength of unity.\r\n\r\n', '11/17/2022', '2022-11-17 14:03:16'),
(1548, 'Festival', 'Junior', 'Panjabi', 'Term 6', NULL, 'SANTHAL DANCE ', '10. SANTHAL DANCE CULTURE T6.pdf', 'hwUploads/10. SANTHAL DANCE CULTURE T6.pdf1668693828', 'The Santhal dance is considered to be one of the best tribal folk dances of India, which offers immense vibrancy and cheerfulness. \r\n\r\nThis dance is supposed to be a replica of the folk dance of Madhya Pradesh. \r\n\r\nSanthal dance is generally performed by both the men and women of the Santhali tribe.\r\n\r\nSanthal is a very popular folk dance of Jharkhand. \r\n\r\nIt is a group dance performed by Santhal tribes of Jharkhand. \r\n\r\nThis dance was performed by the Santhal tribes during all special festivals and occasions. \r\n\r\nThis dance not only reveals the culture or traditions of the local tribes but also showcases the strength of unity.\r\n\r\n', '11/17/2022', '2022-11-17 14:03:48'),
(1549, 'Festival', 'Teen', 'Panjabi', 'Term 6', NULL, 'SANTHAL DANCE ', '10. SANTHAL DANCE CULTURE T6.pdf', 'hwUploads/10. SANTHAL DANCE CULTURE T6.pdf1668693859', 'The Santhal dance is considered to be one of the best tribal folk dances of India, which offers immense vibrancy and cheerfulness. \r\n\r\nThis dance is supposed to be a replica of the folk dance of Madhya Pradesh. \r\n\r\nSanthal dance is generally performed by both the men and women of the Santhali tribe.\r\n\r\nSanthal is a very popular folk dance of Jharkhand. \r\n\r\nIt is a group dance performed by Santhal tribes of Jharkhand. \r\n\r\nThis dance was performed by the Santhal tribes during all special festivals and occasions. \r\n\r\nThis dance not only reveals the culture or traditions of the local tribes but also showcases the strength of unity.\r\n\r\n', '11/17/2022', '2022-11-17 14:04:19'),
(1550, 'Festival', 'PrePrep', 'Panjabi', 'Term 7', NULL, 'LAVANI DANCE ', '11. LAVNI DANCE  CULTURE T7.pdf', 'hwUploads/11. LAVNI DANCE  CULTURE T7.pdf', 'Lavani,is a genre of music popular in Maharashtra, India. \r\nLavani is a combination of traditional song and dance, which particularly performed to the beats of Dholki, a percussion instrument. \r\nLavani is noted for its powerful rhythm. Lavani has contributed substantially to the development of Marathi folk theatre. \r\n\r\nIn Maharashtra and southern Madhya Pradesh, it is performed by the female performers wearing nine-yard long sarees. The songs are sung in a quick tempo.\r\n', '11/17/2022', '2022-11-17 14:08:16'),
(1551, 'Festival', 'Junior', 'Panjabi', 'Term 7', NULL, 'LAVANI DANCE ', '11. LAVNI DANCE  CULTURE T7.pdf', 'hwUploads/11. LAVNI DANCE  CULTURE T7.pdf1668694144', 'Lavani,is a genre of music popular in Maharashtra, India. \r\nLavani is a combination of traditional song and dance, which particularly performed to the beats of Dholki, a percussion instrument. \r\nLavani is noted for its powerful rhythm. Lavani has contributed substantially to the development of Marathi folk theatre. \r\n\r\nIn Maharashtra and southern Madhya Pradesh, it is performed by the female performers wearing nine-yard long sarees. The songs are sung in a quick tempo.\r\n', '11/17/2022', '2022-11-17 14:09:04'),
(1552, 'Festival', 'Teen', 'Panjabi', 'Term 7', NULL, 'LAVANI DANCE ', '11. LAVNI DANCE  CULTURE T7.pdf', 'hwUploads/11. LAVNI DANCE  CULTURE T7.pdf1668694185', 'Lavani,is a genre of music popular in Maharashtra, India. \r\nLavani is a combination of traditional song and dance, which particularly performed to the beats of Dholki, a percussion instrument. \r\nLavani is noted for its powerful rhythm. Lavani has contributed substantially to the development of Marathi folk theatre. \r\n\r\nIn Maharashtra and southern Madhya Pradesh, it is performed by the female performers wearing nine-yard long sarees. The songs are sung in a quick tempo.\r\n', '11/17/2022', '2022-11-17 14:09:45'),
(1553, 'Festival', 'Junior', 'Panjabi', 'Term 7', NULL, 'ROUF DANCE ', '12. ROUF  DANCE CULTURE T7.pdf', 'hwUploads/12. ROUF  DANCE CULTURE T7.pdf', 'ROUF DANCE ( KASHMIRI)\r\nRouf dance is a traditional and rhythmic folk dance of Jammu and Kashmir. Rouf dance is a simple yet cheerful folk dance where you will find women wearing colourful dresses, rhythmically celebrating spring. \r\n\r\nRouf is primarily performed to celebrate the harvesting season of spring. Harvesting season is a special occasion for the farmers, women celebrate this occasion by dancing in unison. \r\n', '11/17/2022', '2022-11-17 14:11:27'),
(1554, 'Festival', 'Teen', 'Panjabi', 'Term 7', NULL, 'ROUF DANCE ', '12. ROUF  DANCE CULTURE T7.pdf', 'hwUploads/12. ROUF  DANCE CULTURE T7.pdf1668694319', 'ROUF DANCE ( KASHMIRI)\r\nRouf dance is a traditional and rhythmic folk dance of Jammu and Kashmir. Rouf dance is a simple yet cheerful folk dance where you will find women wearing colourful dresses, rhythmically celebrating spring. \r\n\r\nRouf is primarily performed to celebrate the harvesting season of spring. Harvesting season is a special occasion for the farmers, women celebrate this occasion by dancing in unison. \r\n', '11/17/2022', '2022-11-17 14:11:59'),
(1555, 'Festival', 'PrePrep', 'Panjabi', 'Term 7', NULL, 'MANI PURI DANCE ', '13. MANI PURI DANCE CULTURE T7.pdf', 'hwUploads/13. MANI PURI DANCE CULTURE T7.pdf', 'MANIPURI DANCE( MANIPUR)\r\nMANIPUR (BASANTI) RAAS LEELA \r\nThe Manipuri Dance, also referred to as the Manipuri Raas Leela, is one of the eight major Indian classical dance forms, originating in the state of Manipur.  The dance form is is exclusively attached to the worship of Radha Krishna. It is a portrayal of the dance of divine love of Lord Krishna with Radha and the cowherd damsels of Vrindavan, famously known as the Raas Leela. \r\n', '11/17/2022', '2022-11-17 14:12:55'),
