(1577, 'Festival', 'PrePrep', 'Panjabi', 'Term 8', NULL, 'ARCHITECTURE OF TEMPLES ', '22. ARCHITECTURE OF TEMPLES CULTURE T8.pdf', 'hwUploads/22. ARCHITECTURE OF TEMPLES CULTURE T8.pdf', 'Exploring Indian temples is a magical experience\r\nMany of these sacred buildings were deliberately built at places rich in positive energy from the magnetic wave lines of the Earth. \r\nMost temples feature one main idol, which has a copper plate called the Garbhagriha or Moolasthan underneath that absorbs and resonates this underground energy. \r\nTherefore, itâ€™s considered good practice to have a bath or shower before entering a temple or at least washing your hands and feet to cleanse yourself of negative thoughts and evil influences.\r\nIt is also a practice to take off footwear before entering places of worship because they would bring in the dirt to an otherwise cleansed and sanctified environment.\r\n\r\nItâ€™s widely believed in India that, going to the temple often helps in having a positive mind and gathering of  positive energies, which in turn lead to healthier functioning.\r\n', '11/17/2022', '2022-11-17 14:36:03'),
(1578, 'Festival', 'Junior', 'Panjabi', 'Term 8', NULL, 'ARCHITECTURE OF TEMPLES ', '22. ARCHITECTURE OF TEMPLES CULTURE T8.pdf', 'hwUploads/22. ARCHITECTURE OF TEMPLES CULTURE T8.pdf1668695809', 'Exploring Indian temples is a magical experience\r\nMany of these sacred buildings were deliberately built at places rich in positive energy from the magnetic wave lines of the Earth. \r\nMost temples feature one main idol, which has a copper plate called the Garbhagriha or Moolasthan underneath that absorbs and resonates this underground energy. \r\nTherefore, itâ€™s considered good practice to have a bath or shower before entering a temple or at least washing your hands and feet to cleanse yourself of negative thoughts and evil influences.\r\nIt is also a practice to take off footwear before entering places of worship because they would bring in the dirt to an otherwise cleansed and sanctified environment.\r\n\r\nItâ€™s widely believed in India that, going to the temple often helps in having a positive mind and gathering of  positive energies, which in turn lead to healthier functioning.\r\n', '11/17/2022', '2022-11-17 14:36:49'),
(1579, 'Festival', 'Teen', 'Panjabi', 'Term 8', NULL, 'ARCHTECTURE OF TEMPLES ', '22. ARCHITECTURE OF TEMPLES CULTURE T8.pdf', 'hwUploads/22. ARCHITECTURE OF TEMPLES CULTURE T8.pdf1668695845', 'Exploring Indian temples is a magical experience\r\nMany of these sacred buildings were deliberately built at places rich in positive energy from the magnetic wave lines of the Earth. \r\nMost temples feature one main idol, which has a copper plate called the Garbhagriha or Moolasthan underneath that absorbs and resonates this underground energy. \r\nTherefore, itâ€™s considered good practice to have a bath or shower before entering a temple or at least washing your hands and feet to cleanse yourself of negative thoughts and evil influences.\r\nIt is also a practice to take off footwear before entering places of worship because they would bring in the dirt to an otherwise cleansed and sanctified environment.\r\n\r\nItâ€™s widely believed in India that, going to the temple often helps in having a positive mind and gathering of  positive energies, which in turn lead to healthier functioning.\r\n', '11/17/2022', '2022-11-17 14:37:25'),
(1580, 'Festival', 'PrePrep', 'Panjabi', 'Term 8', NULL, 'INDIAN SNACKS ', '26. INDIAN SWEETS MAIN CULTURE T8.pdf', 'hwUploads/26. INDIAN SWEETS MAIN CULTURE T8.pdf', 'Samosa\r\nSamosa is a common snack in India and has been a favourite of Indians for generations, although it is quite carb-heavy. \r\nIt is a triangular deep-fried, golden-brown pastry with the savory filling of mashed potatoes, green peas, and spices. \r\nThere are limitless possibilities when it comes to fillings, like eggs, chicken, fried rice, cheese, chocolate, minced meat, pasta, and much more. They taste super delicious with any filling and when complemented by tamarind and mint sauces. Itâ€™s usually paired up with a cup of tea for a heavenly experience!\r\nBhajia/Pakora\r\nThere are many takes on bhajia across India. Essentially, these are spicy fritters made out of potatoes, onions, capsicum, and chilies, dipped in a batter of gram flour and deep fried.\r\n\r\nBombay Mix/Chevra \r\nOtherwise known as mixture, Bombay Mix is a blend of dried ingredients, like chickpeas, lentils, sev, peanuts, and spices that lend it a distinctive taste. \r\nEach region has its own name and version of this snack, and all are equally delicious. \r\nMithai (sweet treats)\r\nThese are an integral part of Indian cuisine.\r\n While theyâ€™re enjoyed during a meal, sweets and desserts are also central to Indian festivals. \r\nSome of these, like laddu, originated in ancient India, but many of them were introduced to the country by the Mughal rulers who came from Persia. \r\nHere are some of the most delicious Indian desserts \r\nJalebi \r\nMake these sweet Indian treats by frying batter into crispy swirls, then dipping them in a sugary syrup made with cardamom and saffron\r\n', '11/17/2022', '2022-11-17 14:41:36'),
(1581, 'Festival', 'Junior', 'Panjabi', 'Term 8', NULL, 'INDIAN SNACKS ', '26. INDIAN SWEETS MAIN CULTURE T8.pdf', 'hwUploads/26. INDIAN SWEETS MAIN CULTURE T8.pdf1668696137', 'Samosa\r\nSamosa is a common snack in India and has been a favourite of Indians for generations, although it is quite carb-heavy. \r\nIt is a triangular deep-fried, golden-brown pastry with the savory filling of mashed potatoes, green peas, and spices. \r\nThere are limitless possibilities when it comes to fillings, like eggs, chicken, fried rice, cheese, chocolate, minced meat, pasta, and much more. They taste super delicious with any filling and when complemented by tamarind and mint sauces. Itâ€™s usually paired up with a cup of tea for a heavenly experience!\r\nBhajia/Pakora\r\nThere are many takes on bhajia across India. Essentially, these are spicy fritters made out of potatoes, onions, capsicum, and chilies, dipped in a batter of gram flour and deep fried.\r\n\r\nBombay Mix/Chevra \r\nOtherwise known as mixture, Bombay Mix is a blend of dried ingredients, like chickpeas, lentils, sev, peanuts, and spices that lend it a distinctive taste. \r\nEach region has its own name and version of this snack, and all are equally delicious. \r\nMithai (sweet treats)\r\nThese are an integral part of Indian cuisine.\r\n While theyâ€™re enjoyed during a meal, sweets and desserts are also central to Indian festivals. \r\nSome of these, like laddu, originated in ancient India, but many of them were introduced to the country by the Mughal rulers who came from Persia. \r\nHere are some of the most delicious Indian desserts \r\nJalebi \r\nMake these sweet Indian treats by frying batter into crispy swirls, then dipping them in a sugary syrup made with cardamom and saffron\r\n', '11/17/2022', '2022-11-17 14:42:17');
