(1582, 'Festival', 'Teen', 'Panjabi', 'Term 8', NULL, 'INDIAN SNACKS ', '26. INDIAN SWEETS MAIN CULTURE T8.pdf', 'hwUploads/26. INDIAN SWEETS MAIN CULTURE T8.pdf1668696182', 'Samosa\r\nSamosa is a common snack in India and has been a favourite of Indians for generations, although it is quite carb-heavy. \r\nIt is a triangular deep-fried, golden-brown pastry with the savory filling of mashed potatoes, green peas, and spices. \r\nThere are limitless possibilities when it comes to fillings, like eggs, chicken, fried rice, cheese, chocolate, minced meat, pasta, and much more. They taste super delicious with any filling and when complemented by tamarind and mint sauces. Itâ€™s usually paired up with a cup of tea for a heavenly experience!\r\nBhajia/Pakora\r\nThere are many takes on bhajia across India. Essentially, these are spicy fritters made out of potatoes, onions, capsicum, and chilies, dipped in a batter of gram flour and deep fried.\r\n\r\nBombay Mix/Chevra \r\nOtherwise known as mixture, Bombay Mix is a blend of dried ingredients, like chickpeas, lentils, sev, peanuts, and spices that lend it a distinctive taste. \r\nEach region has its own name and version of this snack, and all are equally delicious. \r\nMithai (sweet treats)\r\nThese are an integral part of Indian cuisine.\r\n While theyâ€™re enjoyed during a meal, sweets and desserts are also central to Indian festivals. \r\nSome of these, like laddu, originated in ancient India, but many of them were introduced to the country by the Mughal rulers who came from Persia. \r\nHere are some of the most delicious Indian desserts \r\nJalebi \r\nMake these sweet Indian treats by frying batter into crispy swirls, then dipping them in a sugary syrup made with cardamom and saffron\r\n', '11/17/2022', '2022-11-17 14:43:02'),
(1583, 'Festival', 'PrePrep', 'Panjabi', 'Term 8', NULL, 'DRINKING FROM COPPER VESSEL ', '28. DRINK FROM COPPER VESSELSCULTURE T8.pdf', 'hwUploads/28. DRINK FROM COPPER VESSELSCULTURE T8.pdf', 'You might have noticed your grandparents storing and drinking water from copper utensils. \r\nThis practice has â€˜nâ€™ number of health benefits associated with it. \r\nItâ€™s believed that drinking water from a copper vessel can boost your immune system, aid digestion, decrease wound healing time, strengthen joints and improves digestion as well.\r\n', '11/17/2022', '2022-11-17 14:44:13'),
