(1586, 'Festival', 'PrePrep', 'Panjabi', 'Term 8', NULL, 'EATING WITH SILVER CUTLERY ', '30. EATING WITH SILVER CUTLERY CULTURE T8.pdf', 'hwUploads/30. EATING WITH SILVER CUTLERY CULTURE T8.pdf', 'Eating in silver plates has been a part of Indian tradition since long.\r\n You will find several mentions of people eating with silver spoons and plates in historical scriptures as well. \r\nTraditionally,itâ€™s belived that eating with silver cutlery is actually good for your body as silver has anti-viral and anti-bacterial properties, which helps to fortifying the food you\r\n', '11/17/2022', '2022-11-17 14:49:11'),
