(1589, 'Festival', 'PrePrep', 'Panjabi', 'Term 8', NULL, 'WALKING BAREFOOT ON GRASS ', '29. WALKING BAREFOOT CULTURE T8.pdf', 'hwUploads/29. WALKING BAREFOOT CULTURE T8.pdf', 'Freshly mowed grass bed and dew drops on top, just thinking about it blows a feeling of freshness all over. Several researches have shown than walking barefoot on grass can help improve sleep, reduce pain, decrease muscle tension and lower stress levels. So just take off those shoes and take out some time to walk barefoot on grass.', '11/17/2022', '2022-11-17 14:51:40'),
(1590, 'Festival', 'Junior', 'Panjabi', 'Term 8', NULL, 'WALKING BAREFOOT ON GRASS ', '29. WALKING BAREFOOT CULTURE T8.pdf', 'hwUploads/29. WALKING BAREFOOT CULTURE T8.pdf1668696739', 'Freshly mowed grass bed and dew drops on top, just thinking about it blows a feeling of freshness all over. Several researches have shown than walking barefoot on grass can help improve sleep, reduce pain, decrease muscle tension and lower stress levels. So just take off those shoes and take out some time to walk barefoot on grass.', '11/17/2022', '2022-11-17 14:52:19'),
