(1592, 'Festival', 'Junior', 'Hindi', 'Term 1', NULL, 'MAKAR SANKRANTI (MAGHI)', '3.MAKER SAKRANTI T1 HIN CULTURE.pdf', 'hwUploads/3.MAKER SAKRANTI T1 HIN CULTURE.pdf', 'WHAT IS IT ?\r\nA festival dedicated to the Deity Surya (sun)\r\nWHY ?\r\nItâ€™s a colourful festival that marks the end of winter season and longer days.\r\nWHAT FOOD IS EATEN ?\r\nItâ€™s is all about eating laddoo and gajak, bonfires,feasts, singing and dancing ! \r\nThe day ends with relishing khichri, mashed potato and a wide range of pakoda.\r\nWHAT ELSE HAPPENS ?\r\nMakar Sankranti is also known as the festival for flying kites and considered a healthy ritual as it exposes the body in the sun during morning hours. ', '11/18/2022', '2022-11-18 00:37:44'),
(1593, 'Festival', 'Junior', 'Hindi', 'Term 1', NULL, 'RAKSHA BANDHAN', '4.RAKSHA BANDHAN T1 HIN CULTURE.pdf', 'hwUploads/4.RAKSHA BANDHAN T1 HIN CULTURE.pdf', 'WHAT HAPPENS ?\r\nCOTTON BRACELET TIED BY A SISTERS TO HER BROTHER WRIST (OR SOMEONE SHE CONSIDERS HER BROTHER) AND PLACES SWEET IN HIS MOUTH\r\nBROTHERS GIVE GIFT TO HER \r\nWHY IS IT CELEBRATED ?\r\n A CELEBRATION OF THE LOVE BETWEEN BROTHERS, SISTERS AND FRIENDS \r\nCELEBRATES THE BOND, LOVE AND AFFECTION BETWEEN A BROTHER AND SISTER\r\n\r\nWHAT IS THE MEANING ?\r\nRAKHSHA MEANS PROTECT AND BANDHAN MEANS  TO TIE\r\nBROTHERS PROMISE TO LOOK AFTER AND PROTECT THEIR SISTER FROM HARM \r\nAND SISTERS PRAY FOR THEIR BROTHERS WELL BEING\r\nWHEN IS IT CELEBRATED ?\r\nFULL MOON IN MONTH OF AUGUST \r\nMODERN TRADITIONS \r\nTHESE DAYS ANYONE CAN TIE A RAKHI ON EACH OTHERS \r\nSISTERS TO EACH OTHER/DAUGHTERS TO DADS /FRIENDS ', '11/18/2022', '2022-11-18 00:41:40'),
(1594, 'Festival', 'Junior', 'Hindi', 'Term 1', NULL, 'TAJ MAHAL', '6.TAJ MAHAL T1 HIN CULTURE.pdf', 'hwUploads/6.TAJ MAHAL T1 HIN CULTURE.pdf', 'WHAT DOES IT MEAN ?\r\nIN ARABIC MEANS CROWN OF PALACES)\r\nWHERE IS IT ?\r\nâ€¢	Built in Agra (Uttar Pradesh)in 1632\r\nWHATâ€™S IT MADE OF ?\r\nâ€¢	Ivory/ white marble building\r\nWHY WAS IT BUILT/WHO?\r\nâ€¢	Built by Emperor Shah Jahan in honour of his wife (tomb)\r\nHOW LONG DO YOU THINK IT TO BUILD ?\r\n17 years \r\n', '11/18/2022', '2022-11-18 00:44:05'),
(1595, 'Festival', 'Junior', 'Hindi', 'Term 1', NULL, 'RED FORT (LAL QUILA)', '7.RED FORT T1 HIN CULTURE.pdf', 'hwUploads/7.RED FORT T1 HIN CULTURE.pdf', 'WHERE IS IT ?\r\nâ€¢	Old Dehli\r\n        WHATâ€™S IT MADE OF ?\r\nâ€¢	Made of red stone and marble \r\nIt was actually white originally built with sand stones which started chipping off so it was painted red!\r\nWHO WAS IT BUILT BY ?\r\nâ€¢	Built by emperor Shah Jahan in 1638 ( same one as Taj mahal!)\r\n     HOW LONG DID IT TAKE TO BUILD ?\r\n10 years \r\n', '11/18/2022', '2022-11-18 00:46:20'),
(1596, 'Festival', 'Junior', 'Hindi', 'Term 1', NULL, 'DIWALI (FESTIVAL OF LIGHT)', '8.DIWALI T1 HIN CULTURE.pdf', 'hwUploads/8.DIWALI T1 HIN CULTURE.pdf', 'â€¢	1.WHY IS DIWALI CELEBERATED ?\r\nâ€¢	Celebrates new beginnings and the triumph of good over evil and light over darkness. \r\nâ€¢	Diwali is celebrated on NEW MOON DAY, when itâ€™s absolute darkness. \r\nâ€¢	WHAT HAPPENS ?\r\nâ€¢	Houses are lit with candles, colourful lights and firework displays and families share gifts and feast together. \r\nâ€¢	Therefore, people light lamps and candles to get rid of darkness.\r\nâ€¢	CELEBRATE WITH RANGOLIS,DIYASAND WORSHIP GODDESS LAXSHMI\r\nâ€¢	HOW LONG IS DIWALI \r\nâ€¢	FIVE DAY FESTIVAL OF LIGHTS\r\nâ€¢	WHICH MONTH IS IT CELEBRATED ?\r\nâ€¢	CELEBRATED LATE OCTOBER /NOV  \r\n', '11/18/2022', '2022-11-18 00:48:20'),
(1597, 'Festival', 'Junior', 'Hindi', 'Term 1', NULL, 'NAVARATRI', '9.NAVARATRI T1 HIN CULTURE.pdf', 'hwUploads/9.NAVARATRI T1 HIN CULTURE.pdf', '    HOW LONG IS IT ?\r\nThis is a 9 ( Noh) day festival full of fun \r\nWHEN IS IT ?\r\ncelebrated in September/October\r\nWHAT HAPPENS ? \r\nEveryone gets together for dances like Raas and Garbaa and wear different colour clothes on each day. \r\nWHY IS IT CELEBRATED ?\r\nThe 9 nights are dedicated to 3 ( Teen) goddesses into 3 sets of days. 10th day is DUSSEHRA â€“ Lord Ram killed Ravana\r\nâ€¢	3 days: Goddess Durga â€“ Goddess of Power and Energy\r\nâ€¢	3 days: Goddess Lakshmi â€“ Goddess of Wealth and Prosperity\r\nâ€¢	3 days: Goddess Saraswati â€“ Goddess of Knowledge, Wisdom, Art and Music\r\n', '11/18/2022', '2022-11-18 00:49:49'),
