(1796, 'Festival', 'PrePrep', 'Gujarati', 'Term 1', NULL, 'MAKAR SAKRANTI', '3.MAKER SAKRANTI T1 HIN CULTURE.pdf', 'hwUploads/3.MAKER SAKRANTI T1 HIN CULTURE.pdf1668763658', 'A festival dedicated to the Deity Surya (sun)\r\nWHY ?\r\nItâ€™s a colourful festival that marks the end of winter season and longer days.\r\nWHAT FOOD IS EATEN ?\r\nItâ€™s is all about eating laddoo and gajak, bonfires,feasts, singing and dancing ! \r\nThe day ends with relishing khichri, mashed potato and a wide range of pakoda.\r\nWHAT ELSE HAPPENS ?\r\nMakar Sankranti is also known as the festival for flying kites and considered a healthy ritual as it exposes the body in the sun during morning hours. \r\n', '11/18/2022', '2022-11-18 09:27:38'),
