(1845, 'Festival', 'Teen', 'Gujarati', 'Term 2', NULL, 'GUJARATI WEDDING ', 'GUJRATHI-Wedding-Flashcard.pdf', 'hwUploads/GUJRATHI-Wedding-Flashcard.pdf1668767314', 'WEDDING CEREMONY Week 14 \r\nBARAAT\r\nThe groom arrives at the wedding ceremony location with his BARAAT of family and friends and everyone dances in celebration. \r\nPONKVU\r\nThe arrival of the groom, or the PONKVU, is the official start of the Gujarati wedding. The groom is welcomed by his mother-in-law at the entrance. She will perform the AARTI (prayer)\r\nJAIMALA\r\nThe bride comes out and she will exchange garlands with her groom-to-be.\r\nMADHUPARKA\r\nThe groom is welcomed to the mandap by his future mother-in-law. In the MADHUPARKA the groomâ€™s feet are washed and he is offered honey and milk. It is at this time that the saalis (sister-in-law) will try to steal the groomâ€™s shoes. If his shoes are stolen, he must offer the sisters money in order to get them back.\r\nKANYA PADHRAVO\r\nThe bride is led to the mandap by her maternal uncle. When she reaches the mandap, there is an antarpaat (curtain) which separates her from her groom. The acharya begins the ceremony and the antarpaat is lowered and couple exchanges garlands. The wedding ceremony takes place in front of a sacred fire and is conducted by the pundit.\r\nKANYA DAAN\r\nThis ritual is when the bride is given away by her parents and the brideâ€™s hand is placed over the groomâ€™s. The brideâ€™s parents do not eat before the wedding to make themselves pure for the occasion. In essence, the brideâ€™s parents are handing over the Goddess Laxmi (their daughter) to Lord Vishnu (the groom).\r\nHASTA MILAP\r\nThe groomâ€™s scarf is tied to the brideâ€™s saree which symbolizes the union of their two souls. The acharya chants mantras to invoke the blessings of Goddess Laxmi and Goddess Parvati for the bride. The relatives also come together to bless the couple and shower grains of rice and rose petals on them.\r\nVARMALA\r\nIn this ceremony, a cord is tied around the coupleâ€™s necks to protect them from evil. These cords are traditionally tied by the elders of the bride and groom.\r\nMANGAL PHERAS\r\nThe bride and groom circle the sacred fire four times, signifying the four basic human goals of Dharma, Artha, Kama, and Moksha. Meanwhile, the acharya chants mantras and the groom also recited them. As a fun tradition, at the end of the pheras, the bride and groom will run to sit down first. It is said that the one who finds a seat first will rule the house.\r\nSAPTAPADI\r\nThe groom helps the bride touch seven betel nuts with her right toe, while they recite the seven vows. With each step, the groom chants mantras in which he requests support from his wife.\r\nSAUBHAGYAVATI BHAVA\r\nIn this tradition, seven married women from the brideâ€™s side will pass by the couple at this time and whisper blessings into the brideâ€™s right ear.\r\nCHERO PONKVANU\r\nTraditionally, when the brideâ€™s mother passes, the groom will tug at her sari as a way of asking the brideâ€™s family for gifts.\r\nASHIRWAAD\r\nThe Gujurati wedding concludes with the Ashirwaad in which the couple asks for the blessings of their elders.\r\n', '11/18/2022', '2022-11-18 10:28:42'),
