(1867, 'Festival', 'Junior', 'Gujarati', 'Term 2', NULL, 'GOLDEN TEMPLE ', 'golden temple.pdf', 'hwUploads/golden temple.pdf1668767894', 'WHERE IS IT ?\r\nIn Amritsar, Punjab.NW OF INDIA \r\nWHAT IS IT ?\r\nâ€¢	Holiest most religious Gurdwara for Sikhs\r\nANOTHER NAME FOR IT ?\r\nâ€¢	Also known as DARBAR SAHIB( SACRED AUDIENCE )/HARMANDER SAHIB \r\nWHEN WAS IT BUILT?\r\nâ€¢	Was inititiated by Guru Arjan( 5th sikh Guru)  Built around man made river in 1581 - 1589 \r\nâ€¢	It was destroyed many times by Afghan invaders and finally rebuilt during the reign of Maharaja Ranjit Singh ( 1801-39)\r\nWHAT IS IT MADE OF ?\r\nâ€¢	Made of Marble and Copper and overlaid with Gold Foil\r\nWHAT IS SO SPECIAL ABOUT THE WATER AROUND IT ?\r\nâ€¢	The water is believed to have healing powers, for those who bathe in it \r\nINTERESTING FACTS \r\nâ€¢	Itâ€™s the largest FREE kitchen in the world!\r\nMore than 50,000 vegetarian meals are served and cooked by volunteers in one day \r\nâ€¢	Long before it was built, Guru Nanak Dev Ji ( 1st Guru used to meditate at this site\r\nâ€¢	LANGAR means a communal meal /kitchen  \r\nâ€¢	SEWA means selfless service ( to perform an act without expecting reward)\r\n\r\n', '11/18/2022', '2022-11-18 10:38:14'),
