(1883, 'Festival', 'PrePrep', 'Gujarati', 'Term 2', NULL, 'ANIMALS IN INDIA ', 'BENGAL TIGER.pdf', 'hwUploads/BENGAL TIGER.pdf', 'WHAT IS NATIONAL SYMBOL OF INDIA ? \r\nâ€¢	National symbol of India is the endangered Bengal Tiger.\r\nHOW MANY SPECIES OF ANIMALS IN INDIA ?\r\nâ€¢	India has 65,000 animal species\r\nWHAT ANIMALS DO YOU KNOW THAT LIVE IN INDIA? \r\nâ€¢	 ELEPHANTS, PYTHONS, RHINOS(as well as 12,000 flowering plants).\r\n    WHATâ€™S THE DIFFERENCE BETWEEN AN          INDIAN AND AFRICAN ELEPHANT ?\r\nThe Great Indian Elephant has smaller ears than the African Elephant.\r\nINTERESTING FACTS \r\nâ€¢	India is the only country in the world with BOTH LIONS AND TIGERS.\r\nâ€¢	The Great Indian Elephant, is the biggest and tallest HERBIVORE in INDIA.\r\n', '11/18/2022', '2022-11-18 10:44:58'),
