(1998, 'Festival', 'PrePrep', 'Gujarati', 'Term 3', NULL, 'INDIA FOOD AND SPICES ', 'Food & Spices.pdf', 'hwUploads/Food & Spices.pdf', 'India is a large and very diverse country, with a wide variety of agricultural products, which differ from region to region.\r\nWHAT ARE THE MAIN INDIAN STAPLE FOODS\r\nIndian staple food are rice, lentils, breads( roti/naan) and spices. \r\nMany dishes contain vegetables, such as spinach, peas or mustard greens as well as fruit such as mango, pineapple or bananas.\r\nWHAT ARE THE COMMONLY USED SPICES?\r\nIndian food is generally famous for being spicy.Commonly used spices are chilli and ginger, cardamon, cinnamon, cumin, coriander and cloves.\r\nOTHER FACTS \r\nMany dishes also use yoghurt, cottage cheese or paneer \r\nFish and seafood at the coastal regions \r\n', '11/18/2022', '2022-11-18 12:31:31'),
