(2011, 'Festival', 'PrePrep', 'Gujarati', 'Term 3', NULL, 'INDIAN INSTRUMENTS ', 'Musical Instruments.pdf', 'hwUploads/Musical Instruments.pdf', 'WHAT ARE THE MAIN MUSICAL INSTRUMENTS IN INDIA ?\r\nSITAR, TABLA, HARMONIUM , BANSURI, DAMRU, DHOL(AK)\r\nSITAR \r\nItâ€™s a stringed instrument with a pear-shaped body with a long, hollow wooden neck and bridge.  It produces a rich sound when the strings are plucked, which resonates due to its design.\r\nTabla\r\nThe tabla consists of two single headed (Daya and Baya)drums that are different from each other in shape and size. \r\nBansuri\r\n \r\nBansuri is a side blown flute and is a single hollow shaft of bamboo consisting of two ends, one closed and another one open. It also consists of six to seven finger holes\r\nDamru\r\nThe damaru is a two headed drum made of wood. The instrument consists of beads and knots in the leather cord which produces sound as it strikes the surfaces\r\n \r\nDhol(ak)\r\nThe Dhol(ak) is a two-headed drum that produces sound when struck by hand and  is mainly used as an Indian Folk Instrument to produce sound during weddings and prayer rituals.\r\n \r\n', '11/18/2022', '2022-11-18 12:37:13'),
