(2048, 'Festival', 'PrePrep', 'Gujarati', 'Term 3', NULL, 'INDIA GATE ', 'India Gate.pdf', 'hwUploads/India Gate.pdf', 'WHERE AND WHAT IS IT ?\r\nIndia Gate, which stands in Delhi, is a war memorial. \r\nWHY WAS IT BUILT?\r\nIt was built in remembrance of over 70,000 soldiers of the British Indian Army who died in the First World War.\r\nHOW HIGH IS IT ?\r\nThe memorial is 42 m/132 ft. high and stands in the middle of a crossroad. \r\nWHATâ€™S ENGRAVED ON IT ?\r\nThe names of 13 218 dead soldiers are engraved in small letters the memorial.\r\n\r\n', '11/18/2022', '2022-11-18 12:50:14'),
