(2066, 'Festival', 'PrePrep', 'Gujarati', 'Term 3', NULL, 'LANGUAGES IN INDIA ', 'Independence & Republic Day.pdf', 'hwUploads/Independence & Republic Day.pdf1668776190', 'HOW MANY LANGUAGES IN INDIA ?\r\nIndia has 22 official languages, namely Assamese, Bengali, Bodo, Dogri, Gujarati, Hindi, Kannada, Kashmiri, Konkani, Maithili, Malayalam, Manipuri, Marathi, Nepali, Oriya, Punjabi, Sanskrit, Santhali, Sindhi, Tamil, Telugu and Urdu \r\nWHATâ€™S MOST COMMON AND HOW MANY SPEAK IT IN INDIA ?\r\nHindi is the most commonly spoken language in India with  551 Million Speakers. \r\nWHATâ€™S SECOND MOST COMMON ?\r\nBengali is the second most widely spoken language after Hindi with around 83 million speakers.\r\nWHATâ€™S THE OLDEST LANGUAGE IN INDIA ?\r\nSanskrit is the oldest language of India and the basis of many modern Indian languages, including Hindi.\r\n', '11/18/2022', '2022-11-18 12:56:30'),
