(2259, 'Festival', 'PrePrep', 'Gujarati', 'Term 6', NULL, 'KATHAKALI', '3. KATHAK KALI DANCE CULTURE T6.pdf', 'hwUploads/3. KATHAK KALI DANCE CULTURE T6.pdf1668789475', 'KATHAKALI is a major form of classical Indian dance.It is a \"story play\" , but one distinguished by the elaborately colourful make-up, costumes and face masks that the traditionally male actor-dancers wear.\r\nKathakali is a Hindu performance art in the Malayalam-speaking southwestern region of Kerala\r\n\r\nKathakali is one of the eight classical dances of India\r\n\r\n A Kathakali performance, like all classical dance arts of India, synthesizes music, vocal performers, choreography and hand and facial gestures together to express ideas. \r\n', '11/18/2022', '2022-11-18 16:37:55'),
