(2285, 'Festival', 'PrePrep', 'Gujarati', 'Term 6', NULL, 'BIHU DANCE ', '9. BIHU DANCE CULTURE T6.pdf', 'hwUploads/9. BIHU DANCE CULTURE T6.pdf1668791197', 'The Bihu dance is an indigenous folk dance from the Indian state of Assam related to the Bihu festival and an important part of Assamese culture. \r\nPerformed in a group, the Bihu dancers are usually young men and women, and the dancing style is characterized by brisk steps, and rapid hand movements.\r\nThe traditional costume of dancers is colorful and centred round the red colour theme, signifying joy and vigour.\r\n \r\n', '11/18/2022', '2022-11-18 17:06:37'),
