(2291, 'Festival', 'PrePrep', 'Gujarati', 'Term 6', NULL, 'SANTHAL DANCE ', '10. SANTHAL DANCE CULTURE T6.pdf', 'hwUploads/10. SANTHAL DANCE CULTURE T6.pdf1668791438', 'The Santhal dance is considered to be one of the best tribal folk dances of India, which offers immense vibrancy and cheerfulness. \r\n\r\nThis dance is supposed to be a replica of the folk dance of Madhya Pradesh. \r\n\r\nSanthal dance is generally performed by both the men and women of the Santhali tribe.\r\n\r\nSanthal is a very popular folk dance of Jharkhand. \r\n\r\n', '11/18/2022', '2022-11-18 17:10:38'),
