(2303, 'Festival', 'PrePrep', 'Gujarati', 'Term 7', NULL, 'ROUF DANCE ', '12. ROUF  DANCE CULTURE T7.pdf', 'hwUploads/12. ROUF  DANCE CULTURE T7.pdf1668792019', 'Rouf dance is a traditional and rhythmic folk dance of Jammu and Kashmir. Rouf dance is a simple yet cheerful folk dance where you will find women wearing colourful dresses, rhythmically celebrating spring. \r\n\r\nRouf is primarily performed to celebrate the harvesting season of spring. Harvesting season is a special occasion for the farmers, women celebrate this occasion by dancing in unison. \r\n', '11/18/2022', '2022-11-18 17:20:19'),
