(2310, 'Festival', 'PrePrep', 'Gujarati', 'Term 7', NULL, 'MANIPURI DANCE ', '13. MANI PURI DANCE CULTURE T7.pdf', 'hwUploads/13. MANI PURI DANCE CULTURE T7.pdf1668792310', 'The Manipuri Dance, also referred to as the Manipuri Raas Leela, is one of the eight major Indian classical dance forms, originating in the state of Manipur.  The dance form is is exclusively attached to the worship of Radha Krishna. It is a portrayal of the dance of divine love of Lord Krishna with Radha and the cowherd damsels of Vrindavan, famously known as the Raas Leela. ', '11/18/2022', '2022-11-18 17:25:10'),
