(2352, 'Festival', 'PrePrep', 'Gujarati', 'Term 8', NULL, 'ARCHITECTURE OF TEMPLES ', '22. ARCHITECTURE OF TEMPLES CULTURE T8.pdf', 'hwUploads/22. ARCHITECTURE OF TEMPLES CULTURE T8.pdf1668794520', 'Most temples feature one main idol, which has a copper plate called the Garbhagriha or Moolasthan underneath that absorbs and resonates this underground energy. \r\nTherefore, itâ€™s considered good practice to have a bath or shower before entering a temple or at least washing your hands and feet to cleanse yourself of negative thoughts and evil influences.\r\nIt is also a practice to take off footwear before entering places of worship because they would bring in the dirt to an otherwise cleansed and sanctified environment.\r\n', '11/11/2022', '2022-11-18 18:02:00'),
