(2377, 'Festival', 'PrePrep', 'Gujarati', 'Term 8', NULL, 'EATING WITH HANDS ', '30. EATING WITH HANDS CULTURE T8.pdf', 'hwUploads/30. EATING WITH HANDS CULTURE T8.pdf1668795930', 'Eating with hands may not sound great to many people. \r\nHowever, it has many benefits. \r\nFingers being heat receptors, they prevent your mouth from burning when the hot food is put inside. You get to check the temperature before eating the food!\r\nOther than that, you tend to eat slower when you dine with hands, this aids in digestion. \r\n', '11/11/2022', '2022-11-18 18:25:30'),
