(3440, 'Festival', 'Junior', 'Hindi', 'Term 11', NULL, 'BHANGRA ', '1. BHANGRA DANCE CULTURE  T11.pdf', 'hwUploads/1. BHANGRA DANCE CULTURE  T11.pdf', 'BHANGRA is a type of traditional folk dance of the Indian subcontinent, originating in the Sialkot area of Panjab.\r\nIn a typical performance, several dancers execute vigorous kicks, leaps, and bends of the bodyâ€”often with upraised, thrusting arm or shoulder movementsâ€”to the accompaniment of short songs called boliyan and, most significantly, to the beat of a dhol (double-headed drum).\r\n', '11/21/2022', '2022-11-21 14:23:14'),
