(3442, 'Festival', 'Adults', 'Hindi', 'Term 11', NULL, 'BHANGRA ', '1. BHANGRA DANCE CULTURE  T11.pdf', 'hwUploads/1. BHANGRA DANCE CULTURE  T11.pdf1669040694', 'BHANGRA is a type of traditional folk dance of the Indian subcontinent, originating in the Sialkot area of Panjab.\r\nIn a typical performance, several dancers execute vigorous kicks, leaps, and bends of the bodyâ€”often with upraised, thrusting arm or shoulder movementsâ€”to the accompaniment of short songs called boliyan and, most significantly, to the beat of a dhol (double-headed drum).\r\n', '11/21/2022', '2022-11-21 14:24:54'),
(3443, 'Festival', 'Junior', 'Hindi', 'Term 11', NULL, 'BHARATNATYAM', '2. BHARAT NATYAM DANCE CULTURE T11.pdf', 'hwUploads/2. BHARAT NATYAM DANCE CULTURE T11.pdf', 'Bharatanatyam is the oldest classical dance tradition in India.\r\nBharatanatyam contains different types of banis. Bani, or tradition, is a term used to describe the dance technique and style specific to a guru or school. \r\nThese are named according to the village of the guru (with the exception of some banis). \r\nBharatanatyam style is noted for its fixed upper torso, bent legs and knees flexed (Aramandi) combined with spectacular footwork, and a sophisticated vocabulary of sign language based on gestures of hands, eyes, and face muscles.\r\n', '11/21/2022', '2022-11-21 14:26:07'),
