(3446, 'Festival', 'Junior', 'Hindi', 'Term 11', NULL, 'KATHAKALI', '3. KATHAK KALI DANCE CULTURE T11.pdf', 'hwUploads/3. KATHAK KALI DANCE CULTURE T11.pdf', 'KATHAKALI is a major form of classical Indian dance.It is a \"story play\" , but one distinguished by the elaborately colourful make-up, costumes and face masks that the traditionally male actor-dancers wear.\r\nKathakali is a Hindu performance art in the Malayalam-speaking southwestern region of Kerala\r\n', '11/21/2022', '2022-11-21 14:28:12'),
