(3449, 'Festival', 'Junior', 'Hindi', 'Term 11', NULL, 'RAJASTHANI DANCE ', '5. RAJASTHANI DANCE CULTURE T11.pdf', 'hwUploads/5. RAJASTHANI DANCE CULTURE T11.pdf', '\r\nGhoomar or Ghumar is a traditional folk dance of Rajasthan.\r\n\r\n It was Bhil tribe who performed it to worship Goddess Sarasvati which was later embraced by other Rajasthani communities. \r\nThe dance is chiefly performed by veiled women who wear flowing dresses called ghaghara. The dance typically involves performers pirouetting while moving in and out of a wide circle. \r\nThe word ghoomna describes the twirling movement of the dancers and is the basis of the word ghoomar. \r\n', '11/21/2022', '2022-11-21 14:31:07'),
(3450, 'Festival', 'Teen', 'Hindi', 'Term 11', NULL, 'RAJASTHANI DANCE ', '5. RAJASTHANI DANCE CULTURE T11.pdf', 'hwUploads/5. RAJASTHANI DANCE CULTURE T11.pdf1669041096', '\r\nGhoomar or Ghumar is a traditional folk dance of Rajasthan.\r\n\r\n It was Bhil tribe who performed it to worship Goddess Sarasvati which was later embraced by other Rajasthani communities. \r\nThe dance is chiefly performed by veiled women who wear flowing dresses called ghaghara. The dance typically involves performers pirouetting while moving in and out of a wide circle. \r\nThe word ghoomna describes the twirling movement of the dancers and is the basis of the word ghoomar. \r\n', '11/21/2022', '2022-11-21 14:31:36'),
(3451, 'Festival', 'Adults', 'Hindi', 'Term 11', NULL, 'RAJASTHANI DANCE ', '5. RAJASTHANI DANCE CULTURE T11.pdf', 'hwUploads/5. RAJASTHANI DANCE CULTURE T11.pdf1669041127', '\r\nGhoomar or Ghumar is a traditional folk dance of Rajasthan.\r\n\r\n It was Bhil tribe who performed it to worship Goddess Sarasvati which was later embraced by other Rajasthani communities. \r\nThe dance is chiefly performed by veiled women who wear flowing dresses called ghaghara. The dance typically involves performers pirouetting while moving in and out of a wide circle. \r\nThe word ghoomna describes the twirling movement of the dancers and is the basis of the word ghoomar. \r\n', '11/21/2022', '2022-11-21 14:32:07'),
(3452, 'Festival', 'Junior', 'Hindi', 'Term 11', NULL, 'HARAYANA  DANCE ', '7. HARYANA DANCE CULTURE T11.pdf', 'hwUploads/7. HARYANA DANCE CULTURE T11.pdf', 'Girls perform the Loor dance, during the month of Phalguna, also known as the spring season.\r\nThis Loor dance is named after the girls in the Bangar area of Haryana. \r\nIt is specially performed during the Holi festival. \r\nThis dance marks the arrival of pleasant spring season and with it the sowing of the Rabi crops in the farms. \r\nThe songs are generally in the form of questions and answers format. \r\n', '11/21/2022', '2022-11-21 14:33:12'),
