(3455, 'Festival', 'Junior', 'Hindi', 'Term 11', NULL, 'ODISSI DANCE ', '8. ODISSI DANCE CULTURE T11.pdf', 'hwUploads/8. ODISSI DANCE CULTURE T11.pdf', 'Odissi is a major ancient Indian classical dance that originated in the Hindu temples of Odisha â€“ an eastern coastal state of India.\r\nOdissi, in its history, was performed predominantly by women and expressed religious stories and spiritual ideas.\r\n\r\nOdissi performances have also expressed ideas of other traditions such as those related to Hindu gods Shiva and Surya, as well as Hindu goddesses. \r\n', '11/21/2022', '2022-11-21 14:35:20'),
