(3458, 'Festival', 'Junior', 'Hindi', 'Term 11', NULL, 'BIHU DANCE ', '9. BIHU DANCE CULTURE T11.pdf', 'hwUploads/9. BIHU DANCE CULTURE T11.pdf', 'The Bihu dance is an indigenous folk dance from the Indian state of Assam related to the Bihu festival and an important part of Assamese culture. \r\nPerformed in a group, the Bihu dancers are usually young men and women, and the dancing style is characterized by brisk steps, and rapid hand movements.\r\nThe traditional costume of dancers is colorful and centred round the red colour theme, signifying joy and vigour.\r\n', '11/21/2022', '2022-11-21 14:37:41'),
