(3609, 'Festival', 'Adults', 'Gujarati', 'Term 1', NULL, 'FLAG OF INDIA ', 'indian-flag.pdf', 'hwUploads/indian-flag.pdf', 'Colours of the FLAG - known as - 3 colours TIRANGA\r\n1.WHAT ARE THE COLOURS IN GUJARATI ?\r\n2. WHAT DO YOU THINK THEY REPRESENT ?\r\n•	SAFFRON/NARANGI – a symbol of courage and sacrifice\r\n•	WHITE – symbol of honesty, peace and purity\r\n•	GREEN – symbol of growth,fertility, agriculture of land \r\n3.WHAT DOES THE WHEEL REPRESENT ?\r\nThe WHEEL (Ashok chakara)- Wheel of Law has 24 spokes representing 24 hours of the day. \r\nThis means India is hardworking and always in motion, like a spinning wheel\r\n4. WHO DESIGNED THE FLAG OF INDIA ?\r\nAND WHEN ?\r\nPINGALI VENKAYYA IN 1916 THE TRI COLOUR\r\nCHAKRA WAS ADOPTED IN 1931 by CONGRESS COMITTEE \r\n', '07/11/2023', '2023-07-11 11:15:50'),
(3610, 'Festival', 'Adults', 'Gujarati', 'Term 1', NULL, 'NATIONAL SYMBOLS OF INDIA ', 'NATIONAL SYMBOLS (2).pdf', 'hwUploads/NATIONAL SYMBOLS (2).pdf1689074632', '\r\nNATIONAL SYMBOLS OF INDIA\r\n•	National emblem of India is Lion Capital of Ashoka at Sarnath from Ashoka Pillar.\r\n•	 It is 4 lions standing back to back which symbolize Power,Courage,Pride and Confidence) \r\n•	National tree is Banyan tree\r\n•	National fruit is Mango\r\n•	National flower is Lotus flower\r\n•	National Bird is Peacock\r\n•	National Animal is Tiger\r\n', '07/11/2023', '2023-07-11 11:23:52'),
(3611, 'Festival', 'Adults', 'Gujarati', 'Term 1', NULL, 'MAKAR SAKRANTI ', 'Makar Sankranti.pdf', 'hwUploads/Makar Sankranti.pdf', 'WHAT IS IT ?\r\nA festival dedicated to the Deity Surya (sun)\r\nWHY ?\r\nIt’s a colourful festival that marks the end of winter season and longer days.\r\nWHAT FOOD IS EATEN ?\r\nIt’s is all about eating laddoo and gajak, bonfires,feasts, singing and dancing ! \r\nThe day ends with relishing khichri, mashed potato and a wide range of pakoda.\r\nWHAT ELSE HAPPENS ?\r\nMakar Sankranti is also known as the festival for flying kites and considered a healthy ritual as it exposes the body in the sun during morning hours. \r\n', '07/11/2023', '2023-07-11 11:25:10'),
(3612, 'Festival', 'Adults', 'Gujarati', 'Term 1', NULL, 'RAKSHA BANDHAN ', 'RAKSHA BANDHAN.pdf', 'hwUploads/RAKSHA BANDHAN.pdf', '\r\nCOTTON BRACELET TIED BY A SISTERS TO HER BROTHER WRIST (OR SOMEONE SHE CONSIDERS HER BROTHER) AND PLACES SWEET IN HIS MOUTH\r\nBROTHERS GIVE GIFT TO HER \r\nWHY IS IT CELEBRATED ?\r\n A CELEBRATION OF THE LOVE BETWEEN BROTHERS, SISTERS AND FRIENDS \r\nCELEBRATES THE BOND, LOVE AND AFFECTION BETWEEN A BROTHER AND SISTER\r\n\r\nWHAT IS THE MEANING ?\r\nRAKHSHA MEANS PROTECT AND BANDHAN MEANS  TO TIE\r\nBROTHERS PROMISE TO LOOK AFTER AND PROTECT THEIR SISTER FROM HARM \r\nAND SISTERS PRAY FOR THEIR BROTHERS WELL BEING\r\nWHEN IS IT CELEBRATED ?\r\nFULL MOON IN MONTH OF AUGUST \r\nMODERN TRADITIONS \r\nTHESE DAYS ANYONE CAN TIE A RAKHI ON EACH OTHERS \r\nSISTERS TO EACH OTHER/DAUGHTERS TO DADS /FRIENDS \r\n\r\n', '07/11/2023', '2023-07-11 11:26:41'),
(3613, 'Festival', 'Adults', 'Gujarati', 'Term 1', NULL, 'TAJ MAHAL ', 'taj-mahal.pdf', 'hwUploads/taj-mahal.pdf', 'Attracts over million tourists a year!\r\nWHAT DOES IT MEAN ?\r\nIN ARABIC MEANS CROWN OF PALACES)\r\nWHERE IS IT ?\r\n•	Built in Agra (Uttar Pradesh)in 1632\r\nWHAT’S IT MADE OF ?\r\n•	Ivory/ white marble building\r\nWHY WAS IT BUILT/WHO?\r\n•	Built by Emperor Shah Jahan in honour of his wife (tomb)\r\nHOW LONG DO YOU THINK IT TO BUILD ?\r\n17 years \r\nFACTS \r\n1.Emperor was going to build another black marble across the river but a war with his sons imterupted this \r\n2.Dome is called ONION DOME \r\n3. Materials used were transported by 1000 elephants !\r\n4. CHANGES COLOURS at different times of day \r\n  Pinkish tone in morning, milky white in evening and golden at night! to reflect his wife’s moods !\r\n', '07/11/2023', '2023-07-11 11:28:42'),
(3614, 'Festival', 'Adults', 'Gujarati', 'Term 1', NULL, 'DIWALI', 'Diwali.pdf', 'hwUploads/Diwali.pdf', '•	Celebrates new beginnings and the triumph of good over evil and light over darkness. \r\n•	Diwali is celebrated on NEW MOON DAY, when it’s absolute darkness. \r\n•	WHAT HAPPENS ?\r\n•	Houses are lit with candles, colourful lights and firework displays and families share gifts and feast together. \r\n•	Therefore, people light lamps and candles to get rid of darkness.\r\n•	CELEBRATE WITH RANGOLIS,DIYASAND WORSHIP GODDESS LAXSHMI\r\n•	HOW LONG IS DIWALI \r\n•	FIVE DAY FESTIVAL OF LIGHTS\r\n', '07/11/2023', '2023-07-11 11:31:08'),
(3615, 'Festival', 'Adults', 'Gujarati', 'Term 1', NULL, 'REDFORT', 'red-fort.pdf', 'hwUploads/red-fort.pdf', 'WHERE IS IT ?\r\n•	Old Dehli\r\n        WHAT’S IT MADE OF ?\r\n•	Made of red stone and marble \r\nIt was actually white originally built with sand stones which started chipping off so it was painted red!\r\nWHO WAS IT BUILT BY ?\r\n•	Built by emperor Shah Jahan in 1638 ( same one as Taj mahal!)\r\n     HOW LONG DID IT TAKE TO BUILD ?\r\n10 years \r\nFACTS \r\nIt’s main entrance is called LAHORE GATE it opens towards Lahore \r\nOn independence day, the PM of India hoists the Indian flag from LAHORE GATE \r\nIt’s shape is octagonal \r\n    Main residence where emperors lived had lavish parties for 200 years\r\n', '07/11/2023', '2023-07-11 11:33:28');
