(3616, 'Festival', 'Adults', 'Gujarati', 'Term 1', NULL, 'NAVRATRI', 'NAVARATRI.pdf', 'hwUploads/NAVARATRI.pdf', '    HOW LONG IS IT ?\r\nThis is a 9 ( NAU ) day festival full of fun \r\nWHEN IS IT ?\r\ncelebrated in September/October\r\nWHAT HAPPENS ? \r\nEveryone gets together for dances like Raas and Garbaa and wear different colour clothes on each day. \r\nWHY IS IT CELEBRATED ?\r\nThe 9 nights are dedicated to 3 ( Teen) goddesses into 3 sets of days. 10th day is DUSSEHRA – Lord Ram killed Ravana\r\n•	3 days: Goddess Durga – Goddess of Power and Energy\r\n•	3 days: Goddess Lakshmi – Goddess of Wealth and Prosperity\r\n•	3 days: Goddess Saraswati – Goddess of Knowledge, Wisdom, Art and Music\r\n', '07/11/2023', '2023-07-11 11:35:18'),
