(3644, 'Festival', 'Junior', 'Spanish', 'Term 1', NULL, 'SPANISH FLAG - ROJIGUALDA', 'S4K - Spanish Culture_FLAG.pdf', 'hwUploads/S4K - Spanish Culture_FLAG.pdf', 'THE SPANISH FLAG IS MADE UP OF TWO COLOURS, RED AND YELLOW, WITH THE EMBELEM. \r\nTHE ROJIGUALDA’S EMBELEM IS MADE UP OF A COMBINATION OF SIX COATS OF ARMS. IT FEATURES A GOLDEN CASTLE ON A RED BACKGROUND, A RED CROWNED LION ON A WHITE BACKGROUND, VERTICALLY RUNNING RED AND YELOW STRIPES SIMILAR TO THE BANNER OF THE HOUSE OF ARAGON. \r\n', '07/11/2023', '2023-07-11 11:51:48'),
(3645, 'Festival', 'Junior', 'Spanish', 'Term 1', NULL, 'FESTIVAL OF FIRE', 'S4K - Spanish Culture_FIRE.pdf', 'hwUploads/S4K - Spanish Culture_FIRE.pdf', 'Every year, in the city of Valencia, there is a very important festival called las Fallas (the Torches).  In Valencian, it is written Falles.  It is a celebration in honour of San José (Saint Joseph).\r\n\r\nAt the end of February, there is an official ceremony to announce the forthcoming festival.  This announcement is called la Crida. \r\n\r\nThe springtime festival of Fallas begins on 1st March and lasts for 19 days!  At 2pm on 1st March, the festival begins in the main square - la Plaza del Ayuntamiento -  with the use of firecrackers (petardos) known as mascletàs.  The \'Queen of las Fallas\' - known as la Fallera Mayor - declares: “Senyor pirótecnic pot començar la mascletà”.  This means:  \"Mr. Pyrotechnic can begin the firecracker show!\" (la Mascletà)\r\n\r\nThe firecrackers continue to be ignited every day at 2pm until 19th. March.  They are extremely noisy, sounding like gunfire.  In fact, they are 120 decibels!  It is said that you should open your mouth whilst listening in order to preserve your eardrums!', '07/11/2023', '2023-07-11 11:57:52'),
(3646, 'Festival', 'Junior', 'Spanish', 'Term 1', NULL, 'LA TOMATINA', 'S4K - Spanish Culture_TOMATINA.pdf', 'hwUploads/S4K - Spanish Culture_TOMATINA.pdf', 'La Tomatina takes place each year at the end of August in Buñol, Valencia. The festival is part of a week-long celebration in honor of the town\'s patron saints, Luis Bertran and the Mare de Deu dels Desemparats (Mother of God of the Defenseless), the Virgin Mary.\r\n\r\nThis popular festival began by accident on the last Wednesday in August in 1945 during a parade in People\'s Square. There was a parade taking place with musicians, giants, and large heads, and a few youngsters made one of the participants fall, hitting everything that got in his way.\r\n\r\nAt around 11am many trucks haul the bounty of tomatoes into the centre of the town, Plaza del Pueblo. The tomatoes come from Extremadura, where they are less expensive. Technically the festival does not begin until one brave soul has climbed to the top of a two-story high, greased-up wooden pole and reached the coveted ham at the top. In practice this process takes a long time and the festival starts despite no one reaching the meaty prize. The signal for the beginning of the fight is firing of water cannons, and the chaos begins. Once it begins, the battle is generally every man for himself.\r\n', '07/11/2023', '2023-07-11 11:58:56'),
(3647, 'Festival', 'Junior', 'Spanish', 'Term 1', NULL, 'SPANISH FOOD', 'S4K - Spanish Culture_FOOD (1).pdf', 'hwUploads/S4K - Spanish Culture_FOOD (1).pdf', 'Tortilla\r\nThis is the humble Spanish omelette. This can be cooked with lots of delicious ingredients including peppers, chorizo and cheese. But the traditional Spanish tortilla should only be made with eggs, onion, and potatoes.\r\nChorizo\r\nThis is a staple of Spanish cuisine and is famous around the world. This is a spicy, dry cured sausage which can be eaten on its own or used in other dishes such as stews, paella, salads or soups. Chorizo is spiced with plenty of paprika, so gives dishes a deep and rich flavour.\r\nPaella\r\nPaella is one of Spain’s most famous dishes. It is a rice dish that is commonly cooked on a giant pan and uses all sorts of ingredients.\r\nThere are many ways you can cook paella, but the traditional Spanish paella is made using rice, vegetables, stock, chicken thighs, prawns, mussels and squid*.\r\nSaffron is a famous Spanish spice which is used in paellas to give it that bright orange colour. Paella dates back hundreds of years and was eaten by farmers for lunch in the fields and was made using rice and other ingredients they could get their hands on such as tomatoes, snails, rabbit and beans.\r\nFideuà\r\nThis is the cousin to the paella. It\'s a seafood dish cooked with similar ingredients to the paella but includes thin noodles, instead of rice, and is cooked using a fish stock. This dish includes more fish as a paella and traditionally uses monkfish. It originates from the coast in Valencia.\r\n\r\nPatatas bravas\r\nMost cultures have their own take on a fried potato recipe, and the Spanish aren’t any different.\r\n\'Patatas bravas\' translates as ‘spicy potatoes’ and is a dish made from fried, cubed potatoes which is usually covered in a spicy tomato sauce. The sauce is usually made using tomatoes and pimento, which is a sweet paprika.\r\nThis dish was first created in Madrid and is popular with Spaniards as it is a cheap and relatively healthy dish. The \'patatas\' can also be served with aioli, which is a garlic and olive oil sauce.\r\n', '07/11/2023', '2023-07-11 12:00:59'),
(3648, 'Festival', 'Junior', 'Spanish', 'Term 1', NULL, 'SPANISH WEDDINGS', 'S4K - Spanish Culture_WEDDING (1).pdf', 'hwUploads/S4K - Spanish Culture_WEDDING (1).pdf', 'Cutting of the grooms tie\r\nAnother tradition still observed in Spanish weddings is the cutting of the groom’s tie. This custom is said to bring good luck to the newlyweds. The groom’s friend usually performs this task with a pair of scissors.\r\nAfter the groom’s tie has been cut, the friend will sell the tie to a wedding guest to raise money for the couple.\r\nRose petals or rice throwing\r\nThrowing rice or rose petals is a traditional wedding custom you can find worldwide, and it is also observed in Spanish weddings. It is said to bring good luck to the newlyweds. After the ceremony, guests will throw rice over the couple as they leave the church or reception venue.\r\nCake slicing with sword\r\nAnother Spanish wedding tradition comes after the bride and groom say their vows. Now the couple will cut their wedding cake together with a ceremonial sword. This is usually done while the guests are cheering and clapping. After the first slice is cut, the newlyweds will feed each other a piece of cake.\r\nThrowing the bouquet\r\nOne of Spain’s more famous Spanish wedding traditions is the bride throwing her bouquet to the unmarried women in attendance. Whoever catches it is said to be next in line to get married.\r\nOrange Blossom\r\nOrange blossoms symbolise good luck in Spain and are often used as decorations at weddings. They are in the bride’s bouquet, on the wedding cake, or even scattered around the reception venue. The incredible smell of orange blossoms is also a sign of good luck and happiness.\r\nGold Coins (Las areas)\r\nAnother tradition still observed in Spanish weddings is the giving of las areas (gold coins). These are given to the bride by the groom to symbolise his love and commitment. The coins are often placed in a special bag or box and are typically given to the bride during the ceremony. After the wedding, the bride will usually keep them as a memento. A total of 13 coins representing Jesus and his 12 apostles are typically given, and they are often inscribed with the couple’s names and the wedding date.\r\nLibro de familia\r\nThe Libro de familia is an essential document in Spain and is considered the official record of the family. It is updated with each new addition to the family and is used as proof of marriage, birth, and death.\r\nThe couple will receive the book after the honeymoon at their local register office when they deliver their marriage certificate. The Libro de familiar means family book, and in the case of children, their birth will also be registered in this book.\r\nThe book is a treasured item for Spanish families and is often passed down from generation to generation.\r\nSequidillas Manchegas\r\nThe Sequidillas Manchegas is a Spanish folk dance that is often seen as a traditional wedding dance. The dance is traditionally done by the bride and groom and their parents and grandparents. To initiate the dance, the wedding guests pay the bride.\r\nA typical variant of the dance originates from the Spanish region of La Mancha. The dance symbolises the couple’s new life together, and it is also seen as a way to wish the couple good luck and happiness.\r\nExtravagant partying\r\nAt a Spanish wedding reception, it is not uncommon for a big wedding party. This can include drinking, dancing, and even singing. There may also be a band or DJ playing music throughout the night.\r\nThe goal is for the guests to have a good time and celebrate the new marriage. Often, the reception will go on until the early hours of the morning.\r\n', '08/02/2023', '2023-08-02 10:10:50'),
(3649, 'Festival', 'Junior', 'Spanish', 'Term 1', NULL, 'SAN FERMIN', 'S4K - Spanish Culture_FERMIN.pdf', 'hwUploads/S4K - Spanish Culture_FERMIN.pdf', 'The bull runs are actually part of a larger local festival known as San Fermín, taking place in the northern city of Pamplona for a week in early July. Each morning throughout the duration of the festival, participants and bulls take to the streets in a nail-biting race to the bull ring, where a bullfight will take place later in the day. \r\nThe first official documented celebration of San Fermín took place in 1591, and was supposedly a much more low-key affair compared to the raucous celebration we know it as today. Although the rest of the festival is full of unique local traditions, the bull run itself is dangerous and considered by many to be unethical. \r\n', '08/02/2023', '2023-08-02 10:12:31'),
(3650, 'Festival', 'Junior', 'Spanish', 'Term 1', NULL, 'FERIA DE SEVILLA', 'S4K - Spanish Culture_SEVILLA.pdf', 'hwUploads/S4K - Spanish Culture_SEVILLA.pdf', 'Seville’s most iconic celebration, the annual April Fair, is a colorful extravaganza of flamenco, horses, and sherry. Think of it as everything Andalusia is famous for packed into one epic week.\r\nThough it began as a humble livestock fair, the Feria is now a place to see and be seen, with lavishly costumed men and women riding in horse-drawn carriages among the casetas, or tents. Many casetas are private, but several public tents are available, so anyone can enjoy the party. \r\nDuring the day, Feria is a wholesome family affair, with children enjoying the fair rides and families sitting down for long, leisurely meals inside their casetas as traditional music fills the air. At night, however, the event turns practically hedonistic, with free-flowing alcohol and parties raging long after the sun has gone down. \r\n', '08/02/2023', '2023-08-02 10:13:31'),
(3651, 'Festival', 'Junior', 'Spanish', 'Term 1', NULL, 'CHRISTMAS IN SPAIN', 'S4K - Spanish Culture_XMAS (2).pdf', 'hwUploads/S4K - Spanish Culture_XMAS (2).pdf1690971302', 'They say that Christmas is the most wonderful time of the year, and nowhere does that refrain hold true more than in Spain.\r\nWhat makes Christmas in Spain so special? First, you\'ve got the undeniable European wintertime magic. Think charming Christmas markets and holiday lights twinkling throughout the streets. However, Spain\'s pleasant Mediterranean climate and plentiful sunshine make it a much milder alternative to chillier destinations around the same time of year.\r\nSpanish families typically get together for a long, hearty dinner on Christmas Eve, with plenty of after-dinner drinks and conversation prolonging the affair for hours. Christmas Day itself is more low-key, with Santa Claus taking a backseat to the Three Kings who appear a few weeks later but is still a meaningful day shared among loved ones. \r\nSpanish people also feast on lots of festive foods, Marzipan, or Marzapan in Spanish, is another popular Christmas sweet – a sugary treat made from ground almonds and formed into various shapes. Some of the best marzipan in Spain can be found in the small historic town of Toledo just south of Madrid.\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n', '08/02/2023', '2023-08-02 10:15:02');
